INSERT INTO `blogs` (`id`, `name`, `description`, `short_description`, `image`, `status`, `date`, `author`) VALUES
(4, 'Evolution of Coworking offices  in India', '<p>Once upon a time when businesses started booming, all entrepreneurs started setting up their <strong>commercial office on rent and outright</strong>&nbsp;&nbsp;and slowly expanded them across the globe. But with the advent of the technologically advanced era, new businesses started sprouting out like volcanoes and a number of eminent professionals in India as well as in other countries started entrepreneurial ventures. However, unlike the established businessmen they did not have a strong capital support that can help them set up their own office spaces paying high rates. The only investment they had was Knowledge. The concepts like <strong>freelancing</strong> and <strong>work from home</strong> started becoming popular. But the greatest challenge that they faced was keeping the distractions away and having a well-organized office space at home, which was near to impossible with families and friends around anytime and every time.</p>\r\n\r\n<blockquote>\r\n<p>The only investment new and ambitious businesses had was Knowledge.</p>\r\n</blockquote>\r\n\r\n<p>So, how do we help these aspiring professionals have a peaceful work experience? How can we help start-ups get to connect with prospective clients or service providers? How can businesses that run out of small <strong>workspaces</strong> have an opportunity to expand without thinking about congestion at <strong>workspace</strong>? Numerous questions and numerous challenges were popping out day after day.</p>\r\n\r\n<p>This was a point when they were driven by the basic human instincts of mutual existence. Why can&#39;t these aspiring professional have a shared workspace experience? It saves space, money and most importantly provides a platform to connect. A perfect workspace with all facilities free from distractions that gives a combined experience of working on your own will at the same time focused on your ambitions. This is how for the first time emerged in the year 2005 at San Francisco.</p>\r\n\r\n<blockquote>\r\n<p>A coworking space saves space, money and most importantly provides a platform to connect.</p>\r\n</blockquote>\r\n\r\n<p>In India, young ambitious professionals have started coming out of the dogmatic way of working from homes&nbsp;and setting up their work at shared workspaces. From freelancers who pay for a day or a week&nbsp;to businesses that take up co-working spaces for over a month, everyone comes under one roof to have a peaceful and&nbsp;quality work experience.</p>\r\n\r\n<p>You don&rsquo;t have to take your client to a nearby coffee shop or restaurant to discuss business anymore. <strong>Co-working spaces</strong> provide a professional atmosphere for your client meetings which can be conducted in conference halls or workstations that are well-equipped with projectors, printing, photocopying facilities, whiteboards and so on.</p>\r\n\r\n<blockquote>\r\n<p>You don&rsquo;t have to take your client to a nearby coffee shop or restaurant to discuss business anymore.</p>\r\n</blockquote>\r\n\r\n<p><strong>Co-working spaces</strong> provide&nbsp;you the opportunity to connect with other professionals who help in getting your work done while just a few desks away. Thus, you can cut down on movement expenses as well. Such an innovative and most appreciated concept started growing in the metropolitan cities of India where people come together to share their workspace and have a collaborative work experience.</p>\r\n\r\n<p>To create awareness and help professionals realize the benefits of these shared workspaces to the fullest, co-working spaces provide weekly passes for subsidized rates, free workshop tickets, training opportunities and so on. Co-working spaces are one of the well-developed concepts in technologically advanced cities like Mumbai, Bangalore, and Delhi etc.</p>\r\n\r\n<p><strong><em>Who Are We?</em></strong></p>\r\n\r\n<p><strong>The nature of the workspace determines an individual&#39;s success to a large extent. Startups and firms are no exceptions. The long-standing culture of corporate workspaces is being challenged by the emergence of coworking spaces. SpaceHiring.com is an attempt to amplify the voice of every coworking space to reach out to the hard-working masses. We provide such spaces a digital platform to showcase the awesome work environment they&#39;ve created. Additionally, we empower the ones in need of a workplace to look for the nearest &quot;coworking place &quot; and make the right decision.&nbsp;</strong></p>\r\n\r\n<p>You can search commercial offices on rent&nbsp;in Andheri west / east. Compare the rates with <strong>co working offices in andheri west or east,&nbsp;</strong>&nbsp;you will feel the difference</p>', 'Co-working offices  has taken the world by a storm. Ever wondered how it all started? SpaceHiring takes a creative and casual attempt at discussing how the phenomenon started in India.', '4_blog.jpg', 1, '2016-08-03 09:17:24', 'Akshay N'),
(5, '5 Reasons for Startups to Choose Co-working Spaces', '<p>Are you someone who just started taking your first steps in the world of business? Are you a person packed with energy waiting to connect, explore and experience innovative ideas at work? Are you someone who is in search of a perfect office space at a lesser price that will help you climb the initial stages in your business ladder? Have you just started up? If your answer is yes, then the solution to all your queries is a coworking space. As the name suggests, you can take up a workspace shared with aspiring and eminent professionals like you for a day or a week or a month or for any duration of time.</p>\r\n\r\n<p>Here are five things that a <strong>co-working space</strong> can help a start-up with to gear-up.</p>\r\n\r\n<p><strong>Attractive &quot;office space on rent&quot;!</strong></p>\r\n\r\n<p><img alt=\"Attractive coworking office\" src=\"http://3.bp.blogspot.com/-m4dgeD9PW6k/U15xJiLcHPI/AAAAAAAAFOo/RD7t9q9j5Uc/s640/75%5B5%5D.jpg\" style=\"float:left; height:263px; margin-left:20px; margin-right:20px; width:350px\" />As a start-up, you need to ensure that your clients are dragged to your workspace so that they get comfortable to work with you. An attractive, well-decorated and well-furnished workspace is the first face of your company to your clients. Coworking spaces have awesome decor, infrastructure and facilities, which creates a conducive environment for working, especially for the millennials. Our friends at Gpayroll talk about reasons behind the boost in productivity due to an informal work environment in <a href=\"http://www.gpayroll.com/blog/human-resource/benefits-of-an-informal-working-environment.html\" target=\"_blank\">this article</a>.</p>\r\n\r\n<hr />\r\n<p><strong>Flexible work experience</strong></p>\r\n\r\n<p><img alt=\"Flexible Coworking space \" src=\"http://www.thecareermuse.co.in/wp-content/uploads/2015/10/Ideal-Work-Culture-Infographics_CareerBuilder-India-1.jpg\" style=\"height:283px; width:600px\" /></p>\r\n\r\n<p>Ellen Ernst Kossek and Kelly Hannum of Forbes discuss <a href=\"http://www.forbes.com/sites/ccl/2011/06/29/flexibility-can-boost-employee-productivity/#7dfa937f5d04\" target=\"_blank\">how flexibility can boost employee productivity</a>. Inc.com made a detailed analysis of the adverse impact of having 20 hour work days. People pulling off more than 50 hours of work a week are 3 times more susceptible to resorting to alcohol. Alcohol misuse costs the U.S. economy losses of over $223 billion every year. The detailed article can be <a href=\"http://www.inc.com/women-2/why-flexible-working-hours-actually-makes-employees-more-productive.html\" target=\"_blank\">accessed here</a>. Comercial Offices are no more the first choice.&nbsp;</p>\r\n\r\n<blockquote>\r\n<p>Reduced workplace productivity accounts for 72% of the total losses in output of work.</p>\r\n</blockquote>\r\n\r\n<p>The coolest advantage of <strong>coworking office</strong>&nbsp;is that they don&rsquo;t limit the number of people participating in the value creation process. It is not meant just for individuals and freelancers. Let&rsquo;s say you are a team of twenty wanting a private workspace of your own. <strong>Coworking spaces </strong>are available to cater to such needs as well. So you can work anytime of the day with all your team members with all the necessary facilities and privacy in place. It allows you to experience the flexibility of your home with a professional touch.&nbsp;</p>\r\n\r\n<p><strong>Community</strong></p>\r\n\r\n<p><img alt=\"Coworking space community formation\" src=\"https://assets.entrepreneur.com/content/16x9/822/20160201174321-working-community-work-bench-group-young.jpeg\" style=\"float:right; height:281px; width:500px\" /></p>\r\n\r\n<p>Another attractive and unique feature about these shared workspaces is the community you develop with similar startups and freelancers. It gives you an opportunity to learn from their experiences and share yours as well. It provides a platform to connect, explore and work together with other professionals who can be of assistance to your work. It gives you the space to collaborate and work together with professionals from various fields.</p>\r\n\r\n<p><strong>A space for collaboration!</strong></p>\r\n\r\n<p><strong><img alt=\"Coworking space collaborative culture\" src=\"http://crossculturework.com/wp-content/uploads/2016/04/image-2.jpg\" style=\"float:left; height:500px; width:500px\" /></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Are you in&nbsp;&nbsp; need of a designer for your new website? Are you looking for a content writer to boost your business? Are you in need of a lawyer for legal guidance? All these professionals are just a few desks away with whom you can connect on a chat over a tea or approach them in their workspace to get their suggestions. So yeah! It is a one stop place that gives you all that you need.</p>\r\n\r\n<p>The extent of collaboration in <strong>coworking spaces</strong> has earned the concept mention in the prestigious Harvard Business Review. Gretchen Spreitzer, Peter Bacevice and Lyndon Garrett share their take on the importance of community building and ease of collaboration in <a href=\"https://hbr.org/2015/05/why-people-thrive-in-coworking-spaces\" target=\"_blank\">this HBR article</a>.</p>\r\n\r\n<p>#coworking offices in Andheri west / east</p>\r\n\r\n<p>#co working office in Mumbai&nbsp;</p>\r\n\r\n<p>#rising Culture of cowroking office</p>\r\n\r\n<p># commercial offices on rent in demand</p>\r\n\r\n<p># commercial Office / shop on rent in Andheri west east</p>\r\n\r\n<p><strong>Don&rsquo;t Break your Bank&hellip;</strong></p>\r\n\r\n<p><img alt=\"Coworking space saves money\" src=\"http://static3.consumerreportscdn.org/content/dam/cro/news_articles/money/CRO_Money_CRMA_March_Don\'t_Break_Piggy_Bank_01-15.png\" style=\"height:365px; width:500px\" /></p>\r\n\r\n<p>Another major challenge faced by start-ups is the exorbitantly high cost of office space. To develop a well-equipped workspace calls for huge investment, which at the time of starting-up is considered risky; One may not know if the business would lead to where we want it to go. Resorting to coworking spaces is a wise choice as you can pay for only the number of days you use the workspace and at the same time get access to all types of facilities from printing, photocopying, Wi-Fi, networking, fully-furnished workstations, cafeteria, lounge and so on.</p>\r\n\r\n<p>Do not feel that you are alone with your start-up. Coworking spaces are here to help you fight the challenges you would face while making your startup a successful business.</p>\r\n\r\n<p>&nbsp;</p>', 'Startups have been some of the quickest adopters of coworking spaces globally. The benefits of such a collaborative office space for upcoming ventures are numerous. Keep reading to know SpaceHiring\'s take on 5 important reasons for startups to go for coworking spaces.', '5_blog.jpg', 1, '2016-08-03 09:17:24', 'Akshay N'),
(6, '4 things you must mull over before deciding your workplace.', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To some people, it&rsquo;s a dilemma and to some, it&rsquo;s an enigma. No wonder, deciding the principle base of your business operations is the complex task as it is a key to unlock the success. &nbsp;The decision regarding the selection of your workspace is based on many criteria, among which scalability of your business and availability of resources and funds plays an important role. Let`s find out the things you need to understand before making an important decision regarding your workspace,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1)&nbsp;&nbsp; &nbsp;Business or Profession</strong></p>\r\n\r\n<p><img alt=\"Business or Profession Space Hiring\" src=\"http://www.strategy-business.com/media/image/StrategyH_thumb5_690x400.jpg\" style=\"float:left; width:50%\" /></p>\r\n\r\n<p><br />\r\nThe career option you have chosen is very critical in deciding the workplace. If you are paving your way towards a business then it&rsquo;s always recommended that you should have your own office because a business model requires employing people under you and a continuous pattern of meeting prospective clients. Under a business model, having your own office comes handy when you are trying to lure the clients and investors towards your business.</p>\r\n\r\n<p>If your choice is a Profession then you can choose a Co-working space because you are required to perform your specialized skills and you certainly don&rsquo;t require employee for that. Majority likes to work as Freelancer and maximum help they require is a manager (in case you become a big thing in market), so the obvious choice become a co-working space because work from home is a lonesome activity whereas in a co-working space you will have a gorgeous office and high chance of building a network and finding much-needed synergy for your growth.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2)&nbsp;&nbsp; &nbsp;Scalability of Business</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Scalability of Business Space Hiring\" src=\"http://www.connectship.com/scalable/scalable3.jpg\" style=\"float:left; width:50%\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The range of your business operations or service offered is another vital aspect for deciding the base. &nbsp;If the business or profession has been initiated with high or medium scalability then it&rsquo;s always preferred to have your own business because the number of dealing in a day will be very high and the strength required to operate the operations will be numerous and it will be difficult to handle the business or profession in a co-working space.&nbsp;</p>\r\n\r\n<p>On the other hand, if you decide to launch your business or profession locally or within a restricted area then the obvious choice shall be a co-working space because there is no prudence in having your own office and employ additional employees and bear the hidden cost. A low scalable business or profession is at its best if operated from a co-working space.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>3)&nbsp;&nbsp; &nbsp;Long Term Investment</strong></p>\r\n\r\n<p><img alt=\"Long Term Investment Space Hiring\" src=\"http://projectm-online.com/app/uploads/long-term-investment-sketch.jpg\" style=\"float:left; width:50%\" /></p>\r\n\r\n<p><br />\r\nThe sole aim of your business and profession is to expand as much as you can in short period of time and you are backed by a strong financial force and that too for a long term then make your &nbsp;way towards building your own office. Your own office will give you benefits like a huge space for maintaining the employee strength, secrecy towards your key operations and carrying out operations in a smooth manner.</p>\r\n\r\n<p>If your goal is sustainability and establishing yourself in market, but you don&rsquo;t have the much-needed capital to run your it at a separate place and it doesn&rsquo;t require expansion in near future then your obvious choice should be a Co-working space where you can deal in your business or profession without incurring expense of your separate office and make it a burden on your growth.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>4)&nbsp;&nbsp; &nbsp;Hidden Costs</strong></p>\r\n\r\n<p><img alt=\"Hidden Costs Space Hiring\" src=\"https://getlocalization.files.wordpress.com/2013/11/iceberg.jpg\" style=\"float:left; width:50%\" /></p>\r\n\r\n<p><br />\r\nOne of the most underrated aspects is hidden costs. Hidden costs are mostly neglected while making the choice in every decision regarding the business or profession. Be it a business or profession, after you have decided your line of work, scalability and the funds you will be backed by, still there is one aspect left without which your decision will be incomplete and that is Hidden costs.<br />\r\nA prudent person will always calculate the precise cost that will be incurred while operating his/her business or profession. Be it a co-working space or separate commercial space, the owner or entrepreneur shall always calculate the every cent that will be spent directly or indirectly on the business or profession and then both the option shall be compared to reach the final decision.</p>\r\n\r\n<p><br />\r\nBefore you reach to a final decision always remember that these 4 things go hand in hand. You cannot decide on the basis of the only aspect and ignore others. For a prudent decision, you shall heed to every aspect equally and do the math before reaching a verdict.&nbsp;<br />\r\n&nbsp;</p>', 'The decision regarding the selection of your workspace is based on many criteria, among which scalability of your business and availability of resources and funds plays an important role.', '6_blog.jpg', 1, '2016-10-27 08:17:54', 'Malhi Surendra'),
(8, 'Demonetization became a booster for Residential Rental Property Market', '<p><strong>Demonetization became a booster for Residential Rental Property Market</strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.google.co.in/search?q=for+rent&amp;espv=2&amp;biw=1172&amp;bih=371&amp;source=lnms&amp;tbm=isch&amp;sa=X&amp;ved=0ahUKEwjmlPLy0frQAhXIOI8KHWNPDCcQ_AUIBigB#tbnid=Ljb0QwpO7JA9qM:&amp;tbm=isch&amp;q=property+rates+go+down+demonetisation&amp;imgrc=RWbyw-04dEgv1M%3A&amp;tbnh=0&amp;tbnw=0\" style=\"float:left; width:50%\" />Rs 135 Lakh Crores worth Indian residential rental property market has seen a boom since the famous demonetization era has begun. The demonetization has emerged as a positive element for the rental sector of the real estate market. The demand for the rental residential property has boosted overnight, and so as the rental sector.</p>\r\n\r\n<p>The latest trend shows that the demand in the rental property market has increased by 15% in Delhi-NCR areas and by 12% in the Mumbai. The overall increase in the country is by 12% in the rental market. The sudden increase is said to be a positive impact of the demonetization, because people are making quick and frequent inquiries about properties for rent instead of buying them. The Real estate agents believe that the rental sector will see a boom soon and it will give rise to the residential rental property market.</p>\r\n\r\n<p>Earlier it was believed that the prices of the properties will fall by 20%-30% because of the demonetization, but the real estate sector has already seen a downfall to its lowest in the last one or two years, so there was no point of believing that the prices will go down because of the demonetization.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.google.co.in/search?q=for+rent&amp;espv=2&amp;biw=1172&amp;bih=371&amp;source=lnms&amp;tbm=isch&amp;sa=X&amp;ved=0ahUKEwjmlPLy0frQAhXIOI8KHWNPDCcQ_AUIBigB#tbs=simg%3Am00&amp;tbnid=Ljb0QwpO7JA9qM%3A&amp;docid=P6CZ2d115h6cEM&amp;tbm=isch&amp;imgrc=tX8kqDUy_bxYWM%3A\" style=\"float:left; width:50%\" />The demonetization will bring the transparency in the real estate market and there will be a revolutionary change in the methods of buying properties. The Primary real estate market involves very less black money and it is not at all used for buying properties in the metro cities, Tier-Two and Tier-Three cities.</p>\r\n\r\n<p>The major economists of the country believe that the demonetization will positively impact the real estate sector in the next 6-12 months. During this period the consumers will buy very less&nbsp;homes, and ultimately making it a very good reason for the increase in the demand of&nbsp;residential rental property. The potential buyer, as for now, wants to look at the movement of the real estate sector and willing to stay in the residential rental property. The rental prices are believed to go up soon.</p>\r\n\r\n<p>No doubt, it&rsquo;s a premium time to invest in the real estate market if you are about to invest in residential rental property business. The worth of Residential Rental market in India is 135 Lakh Crores and the market is leaving behind an annual return of 3%-4%. It is prime time to invest, since the demand of the rental properties has increased by 12% in the nation, so if you are an opportunist then it is the best time to grab an opportunity.</p>', 'Rs 135 Lakh Crores worth Indian residential rental property market has seen a boom since the famous demonetization era has begun. The demonetization has emerged as a positive element for the rental sector of the real estate market. The demand for the rental residential property has boosted overnight, and so as the rental sector.', '8_blog.jpg', 1, '2016-12-17 07:04:39', 'Veer Surender Malhi ');
