INSERT INTO `spaces` (`id`, `space_type`, `category`, `posted_by`, `list_type`, `capacity`, `area`, `built_up_area`, `super_built_up_area`, `facing`, `furnish_type`, `location`, `title`, `description`, `email`, `mobile`, `cover_image`, `booking_style`, `user_id`, `service_id`, `status`, `is_trending`, `verified`, `timings`, `views_count`, `data_time`) VALUES
(7, '17', '1', 'owner', '', '150', 15000, '', '', '', '', 'Bandra West, Mumbai, Maharashtra, India', 'Lumos Cowork is a community of startup ', '<p>Our coworking space is most suitable for Tech-Entrepreneurs with 2 to 3 member team.</p>\r\n\r\n<p>Take that plunge! We&rsquo;ve got you covered. Our community is comprised of Freelancers &amp; Solo founders too.&nbsp;</p>\r\n\r\n<p>Whether you are into hyper-local delivery, edtech or travel. We&rsquo;ve previously hosted fast growing startups, to scale thier operations in Mumbai.</p>\r\n', 'hiteshgohil93@yahoo.com', '9619242450', '7_cover.jpg', 1, 5, 0, 1, 0, 0, NULL, 78, '2016-11-02 18:46:21'),
(18, '17', '1', 'owner', '', '20', 9000, '', '', '', '', 'Andheri West, Mumbai, Maharashtra, India', 'Co working shared desk @ 399 Per day Andheri west ', '<p>Andheri West Center: Awfis Andheri West center is spread across an area of 9000 sq. feet having an occupancy of 178 work stations and 5 meeting rooms, Private Cabins, Fixed and Flexible seating options, Conference Rooms, Meeting Rooms, Meeting Pods, as well as meeting lounge&rsquo;s. Our Awfis center also provides members with high technology enabled physical infrastructure which includes Video Projection NFC Cards, CCTV, High-Speed Internet and Laser Printing as well as Administrative Support during office hours. Awfis users will have access to Awfis APP and wallet which enables them to be a part of the Awfis community. It also provides ease of booking and renewing workstations, Meeting rooms and purchasing other amenities like Food &amp; Beverage, printing, merchandise etc. Awfis membership allows unlimited use of Tea/ Coffee vending machine and facility and the use of microwave ovens which are placed at convenient locations.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '9702000037', '18_cover.jpg', 0, 19, 0, 1, 1, 1, '', 376, '2016-11-03 08:12:33'),
(19, '2', '1', 'owner', '', '8', 8250, '', '', '', '', 'Powai, Mumbai, Maharashtra, India', 'Conference room @699 per hr Powai for 6 people ', '<p>Powai Center: Awfis Powai center is spread across an area of 8250 sq. feet having an occupancy of 243 work stations and 5 meeting rooms, Private Cabins, Fixed and Flexible seating options, Conference Rooms, Meeting Rooms, Meeting Pods, as well as meeting lounge&rsquo;s. Our Awfis center also provides members with high technology enabled physical infrastructure which includes Video Projection NFC Cards, CCTV, High-Speed Internet and Laser Printing as well as Administrative Support during office hours. Awfis users will have access to Awfis APP and wallet which enables them to be a part of the Awfis community. It also provides ease of booking and renewing workstations, Meeting rooms and purchasing other amenities like Food &amp; Beverage, printing, merchandise etc. Awfis membership allows unlimited use of Tea/ Coffee vending machine and facility and the use of microwave ovens which are placed at convenient locations.</p>\r\n', 'aakarshalamba.nmims@gmail.com', NULL, '19_cover.jpg', 0, 19, 0, 1, 0, 0, NULL, 143, '2016-11-03 08:12:51'),
(20, '3', '1', 'owner', '', '9', 6900, '', '', '', '', 'Lower Parel, Mumbai, Maharashtra, India', 'Flexible Desk @399 per day / 4999 per month , Fixed desk 11k Lower parel ', '<p>Awfis Lower Parel is spread across an area of 6900 sq. feet and located inside Todi Mills Compound having a capacity of 213 work stations which consists of Private Cabins, Fixed and Flexible seating options, 6 Conference Rooms and Meeting Lounges. Our Awfis center also provides members with high technology enabled physical infrastructure which includes Video Projection, NFC Cards, CCTV, High&shy;Speed Internet and Laser Printing. Awfis users will have access to Awfis APP and wallet which enables them to be a part of the Awfis community. It also provides ease of booking and renewing workstations, Meeting rooms and purchasing other amenities like Food &amp; Beverage, printing, merchandise etc. Awfis membership allows unlimited use of Tea/ Coffee vending machine and facility and the use of microwave ovens which are placed at convenient locations.</p>\r\n', 'aakarshalamba.nmims@gmail.com', NULL, '20_cover.jpg', 0, 5, 0, 1, 0, 0, NULL, 48, '2016-11-03 06:08:50'),
(32, '17', '1', 'owner', '', '100', 3000, '', '', '', '', 'Powai, Mumbai, Maharashtra, India', 'Rs 5999 per mnth per person Flexible t Shared Office Powai', '<p>Mankind&rsquo;s greatest and most persistent victory, has been its evolution. At Of10, we believe your workspace should evolve in tandem with you. Situated in Hiranandani Gardens, Powai; India&rsquo;s Silicon Valley; Of10 is home to creative and passionate millennials looking to change the world with their ideas.</p>\r\n\r\n<p>The spaces we create mould themselves to fit your needs with their intuitive design, world-class amenities and ingrained support systems. You will find yourself in an environment that has been created to encourage innovation, foster collaboration and allow the free-flow of ideas amongst some of the brightest minds in the country. Everything is on us. All you have to do is&nbsp;<strong>change the world</strong></p>\r\n', 'work@of10.in', '9920290368', '32_cover.jpg', 0, 5, 0, 1, 0, 0, NULL, 52, '2016-11-03 06:08:52'),
(35, '2', '1', 'owner', '', '10', 0, '', '', '', '', 'Goregaon West, Mumbai, Maharashtra, India', 'Quistic Fixed desk @6499 per month per person ', '<p>We&#39;re a start-up ecosystem that provides affordable office spaces to businesses. From entrepreneurs to start-ups to freelancers, it offers a range of facilities that enable individuals and businesses to cowork, connect, collaborate, communicate and commercialize their ideas. We don&#39;t just provide an infrastructure we provide an environment. It provides start-ups the opportunity to network, ideate, synergise and seek advice from in-house mentors, as well as each other. The opportunity to learn, grow and give. Simply put, our workspace is a start-up melting pot from where great ideas grow to become greater businesses.</p>\r\n', 'aakarshalamba93@gmail.com', '9821217070', '35_cover.jpg', 0, 19, 0, 1, 0, 0, '', 79, '2016-11-03 08:20:42'),
(44, '17', '1', 'owner', '', '20', 1200, '', '', '', '', 'Andheri West, Mumbai, Maharashtra, India', 'Pleasant Co-Working Office at  Andheri west for 199 rs  per hr', '<p>Services: -Free Unlimited wired and wireless Internet -Free Furnished Conference Room Unlimited Usage -No Electricity Bills -No Landline Bill -Fully Furnished and Air Conditioned -Waiting area at the entrance -Fully Furnished Pantry -Free Daily office cleaning -Tea-Coffee vending machine -Free location address to mention on visiting cards -Calm and quiet corporate atmosphere for growth -No lock in period -Peon available whole day -Decent furniture, designer walls -Ideal For Freelancers, Entrepreneurs, New Start-ups -Located at the most prime location on Andheri Link Road : Crystal Plaza, Opp. Infinity Mall -Crystal Plaza is a corporate hub having offices of top corporate companies in it. -Nearby access to bus depots, railway station, airport and metro station. -Walking distance to all banks, Opp. to Infinity Mall, walking distance to other malls. -Surrounded by all major multiplexes, 50+ restaurants. About Work Stations: -Spacious wooden desks -Sufficient plug points for electronics -Soft boards on all desks -Comfortable chairs (adjustable) -Ample storage space</p>\r\n', 'nisarg10@gmail.com', '9920161493', '44_cover.jpg', 0, 37, 0, 1, 0, 0, NULL, 99, '2016-11-03 03:24:42'),
(58, '16', '1', 'owner', '', '20', 900, '', '', '', '', 'Versova, Mumbai, Maharashtra, India', 'Quaint co-working space @ 299 per day creative freelancers', '<p><strong>Harkat&nbsp;co-working</strong>&nbsp;is an office space created especially for freelancers. It includes all office amenities, such as high speed wifi, printer/scanner and is <strong>open 6 days a week from early morning to late night. </strong></p>\r\n\r\n<p><strong>We majorly promote startup and creative Free-lancers&nbsp;</strong></p>\r\n\r\n<p>our Prices are<strong> 299 per day</strong> per person and <strong>7500 per month</strong> per person<strong>&nbsp;</strong></p>\r\n\r\n<p>The fully air-conditioned studio has both an indoor and an outdoor space with several desk options. One can work on a single desk, on a group work station or sit with the laptop on one of the couches. Plug points are conveniently placed throughout the space &ndash; including the outside area. The space&rsquo;s layout is such that it encourages collaboration and inspiration. Little corners of inspiration are placed thoughtfully within the space, such as a (working) typewriter, a little curated library or a small collection of Bollywood classics. There is an office boy who opens/closes the studio and adds that extra bit of convenience by running errands for Harkat&nbsp;co-workers, and making chai and coffee all throughout the day. <strong>Vegetarian lunch is optionally available.</strong></p>\r\n\r\n<p>Located at the back side of Yari Road in Aaram Nagar II, Harkat Studios is only 2 minutes from the center of Versova and yet extremely quiet and green.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'us@harkat.in', '7718030009', '58_cover.jpg', 0, 34, 0, 1, 0, 0, NULL, 94, '2016-11-02 13:28:36'),
(62, '9', '1', 'owner', '', '20', 3000, '', '', '', '', 'Versova, Mumbai, Maharashtra, India', 'Work Plax - Creative co-working space @399 per day ', '<p>In this ever changing world of growth and demand, There are a number of freelancers and startups in search of a place to have a meeting, a nice cup of morning coffee and a place peaceful enough to relax and work. At the same time are places in and around the city, which are unoccupied during the day and operational just in the evening. We, At Workplax, We work towards providing you with all the basic amenities at an affordable cost, in such underutilised social spaces. We are an alternative to the conventional office but at a fraction of cost in a city like Mumbai.</p>\r\n', 'akhil.garg113@gmail.com', NULL, '62_cover.jpg', 0, 39, 0, 1, 1, 0, NULL, 332, '2016-11-03 08:15:24'),
(63, '3', '1', 'owner', '', '12', 5000, '', '', '', '', 'Mulund West, Mumbai, Maharashtra, India', 'Startup spaceial , The Playce @499 in mulund west  mumbai', '<p>The Playce is a spacious 5,000 sq ft co-working space with plug-n-play work-desks, private cabins, conference rooms, seminar hall &amp; an awesome game room to chill. The Playce can host more than 60 startups, and there are already 25+ teams working out as you read this.</p>\r\n', 'hiteshgohil93@yahoo.com', NULL, '63_cover.jpg', 0, 5, 0, 1, 0, 0, NULL, 105, '2016-11-02 20:30:35'),
(64, '9', '1', 'owner', '', '30', 4500, '', '', '', '', 'Khar West, Mumbai, Maharashtra, India', 'Bhive Space per day @599 , Coworking Space,Khar', '<p>We are an urban center for the arts and technology spread over three floors and 4500 square feet in the heart of Bandra. Think of us as one giant lab/playground inside a fantastical magical bungalow just off Carter Road. We are a one of a kind eco-system with integrated state-of-the art facilities that support performance spaces (with one indoor and one outdoor area), a recording studio, a workshop and seminar space, and co-working and collaborative offices for start-ups and entrepreneurs and an organic cafe.</p>\r\n', 'hiteshgohil93@yahoo.com', NULL, '64_cover.jpg', 0, 5, 0, 1, 0, 0, NULL, 59, '2016-11-03 08:19:29'),
(66, '3', '1', 'owner', '', '30', 5000, '', '', '', '', 'Bandra West, Mumbai, Maharashtra, India', 'Virtual Office In Bandra', '<p>Located in Bandra, Bombay Connect is a vibrant place to work at. Sushrut Munje, 24, founder of Hammer and Mop (Pvt Ltd), works out of Bombay Connects and tells us, &ldquo;I fell in love with the Bombay Connect and Unltd India community when I first saw it. It was the perfect front end for our operations and a perfect atmosphere for us to thrive in. The network we have built here has directly and indirectly resulted in business growth.&rdquo; They provide an ecosystem which has space + services. Space includes the basic office infrastructure which has desk space, Wi-Fi, pantry with unlimited tea/coffee, access to meeting room, conference room and stationary. With services they help with networking, exposure in new markets and in media, access to mentors as well as talents and communities.</p>\r\n', 'hiteshgohil93@yahoo.com', NULL, '66_cover.jpg', 1, 5, 0, 1, 0, 0, NULL, 48, '2016-11-03 02:43:00'),
(67, '3', '1', 'owner', '', '75', 4000, '', '', '', '', 'Churchgate, Mumbai, Maharashtra, India', 'Inspiring Co-Working Space', '<p>As an entrepreneur, you may not have it easy, but you do have a powerful tool: other entrepreneurs in business. If you are looking for a coworking space in Mumbai designed specifically for your needs and/or an opportunity to network with and learn from other awesome entrepreneurs, you’ve found the right place at Our First Office.</p>\r\n', 'hiteshgohil93@yahoo.com', NULL, '67_cover.jpg', 1, 5, 0, 1, 0, 0, NULL, 52, '2016-11-03 06:20:31'),
(81, '3', '1', 'owner', '', '1', 100, '', '', '', '', 'Vile Parle East, Mumbai, Maharashtra, India', 'Desk in UMADII Design', '<p>UMADII Design studio wants to share a space who likes to have their own personal space with studio environment.&nbsp;</p>\r\n\r\n<p>Space is surrounded by peace and plants.&nbsp;</p>\r\n\r\n<p>Domestic Airport 1km away.</p>\r\n\r\n<p>Studio includes High-Speed Internet, Air Con, Small Fridge, Water and Washroom.&nbsp;</p>\r\n\r\n<p>Strong Ginger Tea, Black Tea, Strong Cofee, Masala Milk is just a step away.&nbsp;</p>\r\n', 'vipinpharkya@gmail.com', '7506800648', '81_cover.jpg', 0, 50, 0, 1, 0, 0, 'From 9:00 AM to 9:00 PM', 151, '2016-11-02 20:29:57'),
(82, '3', '1', 'owner', '', '1', 100, '', '', '', '', 'Kandivali West, Mumbai, Maharashtra, India', 'Shared Office Space & Coworking Space In Xth Central Mall', '<p>We have a Shared Office Space / Coworking Space based out of Xth Central Mall, Mahavir nagar, Kandivali West Mumbai.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '7x10_Janitor_takes_over_Kelso\'s_office.jpg', 0, 50, 0, 2, 0, 0, NULL, 46, '2016-10-26 09:29:31'),
(90, '3', '1', 'owner', '', '10', 0, '', '', '', '', 'Andheri West, Mumbai, Maharashtra, India', 'Good Office Space At Prime Location At Andheri West', '<p>Fully furnished workspace at prime location in Andheri west ideal for freelancers, entrepreneurs or start-ups with 2 to 10 member teams. Available now for Rent in Mumbai at affordable rates. Offering you all things necessary for a business- high speed wireless internet, conference room (limited usability), fully functional pantry and wooden workstations.&nbsp;</p>\r\n', 'vipinpharkya@gmail.com', NULL, '90_cover.jpg', 0, 50, 0, 2, 0, 0, NULL, 48, '2016-11-02 15:14:59'),
(91, '3', '1', 'owner', '', '25', 0, '', '', '', '', 'Malad West, Mumbai, Maharashtra, India', 'Shared Workstation in Malad West, Mumbai', '<p>Keeping up with our motto of homely and lively workspaces, with assiduous precision, Qdesq caters to you a co working space in Malad west, Mumbai. Ensuring the perfect location for a start up or any business centric hub, we bring at your doorstep, a fully furnished, well-equipped, safe-guarded 25 seater co working space. Instead of sifting through newspaper advertisements for your dream work space, this co working space , at the click of your mouse or the swipe of your screen can be yours. With monthly rented scheme, and open from 9:00 am to 9:00 pm, the place lures IT companies for burning the midnight oil. With sublime environment, this workstation provides exigencies like Cafeteria, Lounge, Conference Room, printer and photocopier, Reception , Locker and car parking.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '91_cover.jpg', 0, 50, 0, 2, 0, 0, NULL, 54, '2016-10-30 16:52:23'),
(92, '4', '1', 'owner', '', '2', 0, '', '', '', '', 'Malad West, Mumbai, Maharashtra, India', '1-2 Seater Private Cabin ', '<p>With assiduous efforts, we offer our&nbsp;customers an urbanely built Private Cabin in Malad West, Mumbai. Specifically built for mini office purposes, this place caters to all the facilities its clientele requires. These include incessant internet connectivity, A/C with power backup, complementary supply of tea/coffee, a reliable car parking and photocopy and printer facilities. The office s well maintained, fully furnished and is accessible from 9:00 am to 9:00 pm on week days. The comfortable and affable aura of this office will definitely set your mind to business.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '92_cover.jpg', 0, 50, 0, 1, 0, 0, NULL, 66, '2016-11-03 01:35:47'),
(93, '3', '1', 'owner', '', '20', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', 'Shared Workstation in Goregaon East', '<p>This beautifully shared office space in Goregaon East offers affordable short- and long-term serviced offices to suit any requirement. Qdesq is a verified branded workspace provider catering you with your diverse needs. The office is situated in Corporate Annexe with a 20 seater capacity. It provides the perfect work environment for start-up companies with facilities like Ac with power backup, Free WiFi, clean toilet, functional workspace, free tea/coffee, Cafeteria, conference room, mailing address, photocopy, printer and meeting room. The professional staff provides an excellent extension to your business.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '93_cover.jpg', 0, 50, 0, 2, 0, 0, NULL, 42, '2016-11-03 01:35:40'),
(94, '3', '1', 'owner', '', '28', 500, '', '', '', '', 'Fort, Mumbai, Maharashtra, India', 'Co-working Desk @ 7000 per person in Fort ', '<p>Lumos us a coworking space conveniently located near CST station. Amenities included are internet, electricity, office boy.</p>\r\n', 'kingkalra@hotmail.com', NULL, '94_cover.jpg', 0, 10, 0, 1, 0, 0, NULL, 59, '2016-11-03 06:27:52'),
(95, '4', '1', 'owner', '', '5', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', 'Virtual Office ', '<p>Virtual Office is available in prime location at Goregaon East, Mumbai. Virtual is the next real. And sometimes virtual offices are even better as they spare you the cost of occupying and doing-up a physical office space. Suitable especially for start-up, small and home-based businesses or those looking for risk free expansion into new markets. A virtual office provides benefits like Flexible need based spending, a great business address to choose from Handling messages, mails and forwarding them as per your instructions.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '95_cover.jpg', 0, 50, 0, 1, 0, 0, NULL, 51, '2016-11-02 13:55:45'),
(96, '2', '1', 'owner', '', '12', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', '12 Seater Meeting Room ', '<p>Beautiful fully furnished 12 seater meeting/board room with an apt layout is accessible inside Corporate Annexe, Goregaon East. This meeting room in Mumbai is available in flexible layouts with Wi-Fi access and world-class audio-visual facilities. Functionality also ensures administrative and technological support to ensure seamless and unhindered meeting/conference. This meeting room is rented on a half day as well as full day basis. It also involves photocopy and printer facilities, reception , personalized mailing address, a conference room, a visitors&#39; lounge and a car parking.</p>\r\n', 'vipinpharkya@gmail.com', NULL, '96_cover.jpg', 0, 50, 0, 2, 0, 0, NULL, 50, '2016-11-01 15:52:34'),
