(147, '4', '1', 'owner', '', '4', 0, '', '', '', '', 'Worli, Mumbai, Maharashtra, India', 'Cabin for max 4 people @42000/month + tax in Igloo, Worli', '<p>Igloo is an initiative of&nbsp;<strong>Dalberg Global Development Advisors Asia.</strong></p>\r\n\r\n<p>Dalberg Global Development Advisors is a strategy and policy advisory firm exclusively dedicated to global development and innovation. Established in New York in 2001, with a network that now includes 12 offices in five continents, its mission is to mobilize effective responses to the world&rsquo;s most pressing issues and to raise living standards in developing countries. Dalberg strives to achieve social impact by creating value for its clients. Its core advisory services include: (i) developing innovative strategies, approaches and market mechanisms; (ii) reforming internal organizational processes and structures; (iii) analyzing global markets and developing market-entry strategies; and (iv) coordinating and facilitating large, multi-stakeholder initiatives. Dalberg focuses on 11 key sectors: Access to Finance; Agriculture and Food Security; Conflict, Human Rights and Humanitarian Aid; Corporate; Education; Energy and Environment; Gender Empowerment; Global Health; ICT and Mobile for Development; Inclusive Growth; and Strategy and Performance.&nbsp;</p>\r\n', 'aakarshalamba.nmims@gmail.com', '912232221001', '147_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 45, '2016-10-26 13:02:38'),
(148, '3', '1', 'owner', '', '1', 0, '', '', '', '', 'Fort, Mumbai, Maharashtra, India', 'Fixed desk @800/day in Ministry of New, Fort', '<p>We invite entrepreneurs, designers and architects from India and abroad to join Ministry Of New, a new flexible work- and event space in the heart of Bombay.<br />\r\n<br />\r\nPricing is as follows:<br />\r\nRs 800 / day / member<br />\r\nRs 40000 / month / 4 members.<br />\r\n<br />\r\nDuring the week,from Monday till Friday from 8am till 8pm &#39;Ministry Of New&#39; is a coworking space.&nbsp;<br />\r\n<br />\r\nEntrepreneurs, designers and architects from India and abroad can rent one of the 12 modern, personal desks including storage on a monthly base, or can work from the communal table on a 10-days membership base.<br />\r\n<br />\r\nOur shared space has an open layout, an entresol with a meeting room and a small conference call room. Members bring their own computer, but we provide large modern desks, chairs, a printer/copier, beamer and a white board. Of course there is reliable, high capacity Wifi. Our big communal table is perfect for brainstorming or an after work drink. A library will be kept up to date with daily newspapers and the latest magazines and books related to design, India etc. The kitchen area has a cosy bar to sit, a microwave, coffee and espresso machine , an Aquaguard and a fridge. There is a small terrace outside and plenty of parking space as it is situated in a quiet, green street.<br />\r\n<br />\r\nAs &#39;Ministry Of New&#39; has a strong international network, we can provide assistance in connecting local designers and businesses seeking contact with the international design market and other interested clientele.<br />\r\n<br />\r\nAs we are design- and event specialists we are always open to help you with creative and art direction, think tanks, concepts and stylings or to assist you setting up photo shoots and events.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '02266356505', '148_cover.jpg', 0, 19, 0, 1, 0, 0, '8am to 8pm, 5 days a week', 275, '2016-11-03 04:22:03'),
(149, '4', '1', 'owner', '', '4', 0, '', '', '', '', 'Fort, Mumbai, Maharashtra, India', '4 seater cabin @40000/month in Ministry of New, Fort', '<p>We invite entrepreneurs, designers and architects from India and abroad to join Ministry Of New, a new flexible work- and event space in the heart of Bombay.<br />\r\n<br />\r\nPricing is as follows:<br />\r\nRs 800 / day / member<br />\r\nRs 40000 / month / 4 members.<br />\r\n<br />\r\nDuring the week,from Monday till Friday from 8am till 8pm &#39;Ministry Of New&#39; is a coworking space.&nbsp;<br />\r\n<br />\r\nEntrepreneurs, designers and architects from India and abroad can rent one of the 12 modern, personal desks including storage on a monthly base, or can work from the communal table on a 10-days membership base.<br />\r\n<br />\r\nOur shared space has an open layout, an entresol with a meeting room and a small conference call room. Members bring their own computer, but we provide large modern desks, chairs, a printer/copier, beamer and a white board. Of course there is reliable, high capacity Wifi. Our big communal table is perfect for brainstorming or an after work drink. A library will be kept up to date with daily newspapers and the latest magazines and books related to design, India etc. The kitchen area has a cosy bar to sit, a microwave, coffee and espresso machine , an Aquaguard and a fridge. There is a small terrace outside and plenty of parking space as it is situated in a quiet, green street.<br />\r\n<br />\r\nAs &#39;Ministry Of New&#39; has a strong international network, we can provide assistance in connecting local designers and businesses seeking contact with the international design market and other interested clientele.<br />\r\n<br />\r\nAs we are design- and event specialists we are always open to help you with creative and art direction, think tanks, concepts and stylings or to assist you setting up photo shoots and events.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '02266356505', '149_cover.jpg', 0, 19, 0, 1, 0, 0, '8am to 8pm, 5 days a week', 133, '2016-11-02 16:47:06'),
(150, '3', '1', 'owner', '', '10', 0, '', '', '', '', 'Lower Parel West, Mumbai, Maharashtra, India', 'Private desk available @1000/day in Lower Parel', '<p>The whole studio has been set up in three quarters &ndash; starting from the co-working space in one corner to the middle section of the studio selling furniture and artifacts, and ending with a beautifully done-up in-house cafe.</p>\r\n\r\n<p>The furniture has been designed and manufactured by the co-founders themselves, with the whole set-up giving us very Jodhpur-esque vibes.</p>\r\n\r\n<p>Working here doesn&rsquo;t stop at free Wi-Fi &ndash; the design studio has a library and a cafe.</p>\r\n\r\n<p>We spotted a very unique piece of decor that had our fingers itching for our credit card &ndash; a ball-shaped bar to hold mini alcohol bottles. This is a great working space for anyone who needs an aesthetically pleasing space to concentrate, or maybe just wants to get away from their chattering coworkers for a day.</p>\r\n\r\n<p>The space is small and seating limited, so book fast.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 88797 78577', '150_cover.jpg', 0, 19, 0, 1, 0, 0, '10am to 7pm', 54, '2016-11-03 04:22:01'),
(151, '3', '1', 'owner', '', '8', 0, '', '', '', '', 'Oshiwara, Mumbai, Maharashtra, India', 'Fixed desk @7500/month in SumHR, Oshiwara', '<p>1. Located in the self- sustaining Andheri &ndash; Lokhandwala area (a perfect blend of commercial, residential, and entertainment)<br />\r\n2. Easy Access: 2 BEST Bus Depots (3 mins), Train Station (10 mins), and Airport (30 mins).<br />\r\n3. Building houses companies other major business offices and a high-end restaurant on the ground floor.<br />\r\n4. Walking Distance to Major Malls (Mega and Infinity), Best Restaurants (30+), 2 Movie Multiplexes, and Corporate Offices.<br />\r\n5. Coworking Space is on 4th and 6th floors &ndash; fantastic views of the Andheri skyline.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 92222 13195', '151_cover.jpg', 0, 19, 0, 1, 0, 0, '8am to 11pm, Sunday closed', 43, '2016-11-01 18:13:07'),
