(155, '4', '1', 'owner', '', '3', 350000, '', '', '', '', 'Thane West, Thane, Maharashtra, India', 'Private cabin @15000/month in Thane', '<p>Spaces designed for startups, young entrepreneurs, small businesses and innovative minds with different shapes and sizes to give privacy and a confined inventory within the space. This space is designed for minds to collaborate, create a productive environment within their own teams and work cohesively wishing boundaries to achieve there set goals. The prime objective of these spaces are to give privacy in a cowork space. The spaces built by us are so vibrant, creative and productive that even the enclosed spaces give a very welcoming feel to all the clients. Our environment is being designed in such a way that it inculcates the habit of sharing, coworking, disseminating ideas, creating ecosystems within the whole setup.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 98204 14105', '155_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 54, '2016-10-26 10:23:49'),
(156, '2', '1', 'owner', '', '15', 350000, '', '', '', '', 'Thane West, Thane, Maharashtra, India', 'Conference Room for a capacity of 8-15 people available @1250/hr in Thane', '<p>A Private &ndash; Professional managed space for people to have a structured discussions. This room is equipped with state of the art facilities like smart LED TV, Video Conferencing and audio equipments which enables the clients to use these to attain productive results designated to be achieved within the slot these clients book. These rooms are available for existing members and also for people looking for one time, small yet effective rooms to collaborate and disseminate ideas within themselves in a professional manner. These rooms can be booked for an hour, a day and also for longer durations as well depending on availability.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 98204 14105', '156_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 47, '2016-11-02 20:30:24'),
(157, '4', '1', 'owner', '', '3', 0, '', '', '', '', 'Santacruz East, Mumbai, Maharashtra, India', 'Private cabin available @15000/month in Kalina', '<p>At Redbrick Kalina, fully furnished offices space available in Grande Palladium &ndash; one of the most prestigious building in BKC &ndash; Kalina. The building is located at the junction of the BKC &ndash; one of the most prestigious business districts of India and is located right on the Santacruz Chembur Link Road (SCLR) and provides a quick connectivity to Thane and Navi Mumbai. The location has an advantage of its proximity to Airport &amp; Kurla, Bandra, Khar and Santacruz railway stations to ensure amazingly efficient and quick commuter transport. We have premium offices available in multiple configurations and can house companies with 2 to 60 employees.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 22 6940 0300', '157_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 60, '2016-11-01 17:47:28'),
(158, '3', '1', 'owner', '', '1', 0, '', '', '', '', 'Santacruz East, Mumbai, Maharashtra, India', 'Virtual Desk available @4500/month in Kalina', '<p>Its a facility for startups, young business owners and people who either don&rsquo;t want to work out of any space or want presence in the world wherein they can have an address, a telephone number that is answered in there company script and forwarded to them on there cellphone or landlines which they may chose. So to the outsize world it may feel that the person who they have called has an office with us in our location &ndash; but the truth is that he is operating out of a location chosen by our client. The facility is famous with new location presence, having an address on your portfolio or new business locations when you don&rsquo;t know if the decision to go to that new location is the right one.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 98204 14105', '158_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 33, '2016-10-26 10:56:48'),
(159, '4', '1', 'owner', '', '3', 0, '', '', '', '', 'Andheri East, Mumbai, Maharashtra, India', 'Private cabin @15000/month in Andheri East', '<p>Standing tall in the heart of the central business district of Andheri (E), Kaledonia is one of the finest commercial buildings. Kaledonia is located on Sahar Road, Andheri East, 100 meters from Andheri Station. Kalendonia has been designed and built to be a destination commercial centre, offering successful companies a World-Class Corporate Office. The location is ideal for small, medium and large companies looking for flexible space for business. Our location offers independent, flexible, customizable, fully furnished and ready to use commercial spaces.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 98204 14105', '159_cover.jpg', 0, 19, 0, 1, 0, 0, '24X7 access', 52, '2016-11-02 11:56:51'),
