(164, '3', '1', 'owner', '', '36', 0, '', '', '', '', 'Andheri East, Mumbai, Maharashtra, India', 'Shared workstation in Andheri East, Mumbai', '<p>This beautifully shared office space in Andher East offers affordable long-term serviced offices to suit any requirement.&nbsp;The office is situated in HDIL Building with a 36 seater capacity. It provides the perfect work environment for start-up companies with facilities like Ac with power backup, Free WiFi, clean toilet, functional workspace, free tea/coffee, photocopy, printer and meeting room. The professional staff provides an excellent extension to your business.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 22 6788 8000', '164_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 8pm', 132, '2016-11-02 16:40:39'),
(165, '3', '1', 'owner', '', '20', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', 'Desks available @500/day in Goregaon East', '<p>This beautifully shared office space in Goregaon East offers affordable short- and long-term serviced offices to suit any requirement.&nbsp;The office is situated in Corporate Annexe with a 20 seater capacity. It provides the perfect work environment for start-up companies with facilities like Ac with power backup, Free WiFi, clean toilet, functional workspace, free tea/coffee, Cafeteria, conference room, mailing address, photocopy, printer and meeting room. The professional staff provides an excellent extension to your business.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 96190 90766', '165_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 9pm', 52, '2016-10-31 16:36:02'),
(166, '4', '1', 'owner', '', '1', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', 'Private Cabin available in a beautiful building in Goregaon East', '<p>In a tranquilizing and comforting aura&nbsp;A perfect blend of comfort and professionalism, this private cabin will set free your boredom and will set you on work. With explicit location, this office is rented on both daily and monthly tenure. Moreover its availability from 9:00 am to 9:00 pm will is a benefit. This verified private office comes with a wide range of facilities such as Ac with power backup, Free WiFi, clean toilet, functional workspace, free tea/coffee, photocopy, printer, cafeteria, visitors lounge and a reliable car parking.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 96190 90766', '166_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 9pm', 24, '2016-10-26 02:25:19'),
(167, '2', '1', 'owner', '', '8', 0, '', '', '', '', 'Goregaon East, Mumbai, Maharashtra, India', 'Meeting room for a capacity of 8 people in Goregaon East @3500/day and @2000/half day', '<p>Beautiful fully furnished 8 seater meeting/board room with an apt layout is accessible inside Corporate Annexe, Goregaon East. This meeting room in Mumbai is available in flexible layouts with Wi-Fi access and world-class audio-visual facilities. Functionality also ensures administrative and technological support to ensure seamless and unhindered meeting/conference. This meeting room is rented on a half day as well as full day basis. It also involves photocopy and printer facilities, reception , personalized mailing address, a conference room, a visitors&#39; lounge and a car parking.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 96190 90766', '167_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 9pm', 53, '2016-11-02 20:30:25'),
