(171, '3', '1', 'owner', '', '20', 0, '', '', '', '', 'Lower Parel, Mumbai, Maharashtra, India', 'ISHARESPACE has convenient work options for everyone starting @1250/day', '<p>IShareSpace is a&nbsp;new age business centre/ co-working platform&nbsp;providing contemporary, open-planned, well-designed workspaces to suit varied business needs. We provide easy and convenient options for freelancers and entrepreneurs, start-ups and small and medium businesses alike, with a host of value added services thrown into the mix.</p>\r\n\r\n<p>We currently have our flagship space in Residency Road,&nbsp;Bangalore&nbsp;and a centre in Lower Parel&nbsp;Mumbai. IShareSpace centers will be opening shortly in multiple locations in the country. Our spaces are located in the prime business/commercial/technology areas of the cities we operate in, so that our clients are always in the heart of where the action is.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 98200 22727', '171_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 10pm', 59, '2016-11-02 14:29:20'),
