(173, '3', '1', 'owner', '', '30', 0, '', '', '', '', 'Colaba, Mumbai, Maharashtra, India', 'CoWorking in Socials offline @5000/month', '<p>Social Offline is an Office-cum-Cafe. Its very creative and unique idea where you combine work and play. Here, you don&rsquo;t work in a cubicle but in a super-cool cafe.</p>\r\n\r\n<p>The idea is to do the work with a little more creativity. You&rsquo;ll find everything so creative in your surrounding that even when they serve food and what if a bar attached to your boardroom. Yes! it is there.</p>\r\n\r\n<p>So, Social Offline is the coolest place to work. It is a hub for artists and innovaters.</p>\r\n\r\n<p>Social offline is situated in Mumbai, Bangalore as well as New Delhi and they have very good offers at minimal charges.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 22 2282 8484', '173_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 5pm', 45, '2016-11-03 06:17:24'),
