(176, '2', '1', 'owner', '', '4', 0, '', '', '', '', 'Powai, Mumbai, Maharashtra, India', 'Meeting Room C in Trendy Business Centre', '<p>This 4 Seater Meeting Room is available for rent on an hourly or daily basis. It is housed in a Business Centre located in Powai, Mumbai. Powai is well connected through the 6-lane Jogeshwari - Vikhroli Link Road linked strategically to the two crucial arteries of Mumbai, the Western and Eastern Express Highways. The complex enjoys panoramic view of Powai Lake from 220 meters above the sea level. The building provides separate entrance and the well connected central area of the project is free of vehicular traffic.</p>\r\n', 'aakarshalamba.nmims@gmail.com', '+91 22 4201 9111', '176_cover.jpg', 0, 19, 0, 1, 0, 0, '9am to 10pm', 69, '2016-11-02 20:30:26'),
