(383, '17', '1', 'agent', 'rent', '10', 0, '', '', 'north', '', 'Lower Parel West, Mumbai, Maharashtra, India', 'Rise Lower Parel Open Desk ', '<h3>Rise Mumbai connects India to the global FinTech community.</h3>\r\n\r\n<h3>After watching our co-working spaces across the world produce exciting results, we&rsquo;ve brought the same opportunities to Mumbai.Rise Mumbai combines the outstanding facilities our members depend on with the open collaboration they love.We&rsquo;ve used local materials to create a refreshing and vibrant space that gives you plenty of room to explore ideas, collaborate and learn.We offer an inspiring view across Mumbai&rsquo;s financial district, excellent facilities and great coffee. But more importantly, we&rsquo;re offering you a way to meet people who can help make your ideas happen. You&rsquo;ll also be able to take part in events and programs that introduce you to new ideas and help you share your own.</h3>\r\n\r\n<h3>Amenities</h3>\r\n\r\n<h3>Rise Mumbai offers a range of state-of-the-art facilities</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>140 seat auditorium</h3>\r\n	</li>\r\n	<li>\r\n	<h3>64 open desks</h3>\r\n	</li>\r\n	<li>\r\n	<h3>15 offices (90 desks)</h3>\r\n	</li>\r\n	<li>\r\n	<h3>3 meeting rooms</h3>\r\n	</li>\r\n	<li>\r\n	<h3>1 conference room (20 seater)</h3>\r\n	</li>\r\n</ul>\r\n', 'mum@thinkrise.com', '9911153318', 'Rise-Mumbai-6.jpg', 0, 164, 0, 1, 0, 0, '', 39, '2016-11-04 18:47:16'),
(384, '19', '1', 'owner', 'rent', '10', 0, '', '', 'north', '', 'Lower Parel, Mumbai, Maharashtra, India', '20 Seater Conference / training room in lower parel ', '<h3>Rise Mumbai connects India to the global FinTech community.</h3>\r\n\r\n<h3>After watching our co-working spaces across the world produce exciting results, we&rsquo;ve brought the same opportunities to Mumbai.Rise Mumbai combines the outstanding facilities our members depend on with the open collaboration they love.We&rsquo;ve used local materials to create a refreshing and vibrant space that gives you plenty of room to explore ideas, collaborate and learn.We offer an inspiring view across Mumbai&rsquo;s financial district, excellent facilities and great coffee. But more importantly, we&rsquo;re offering you a way to meet people who can help make your ideas happen. You&rsquo;ll also be able to take part in events and programs that introduce you to new ideas and help you share your own.</h3>\r\n\r\n<h3>Amenities</h3>\r\n\r\n<h3>Rise Mumbai offers a range of state-of-the-art facilities</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>140 seat auditorium</h3>\r\n	</li>\r\n	<li>\r\n	<h3>64 open desks</h3>\r\n	</li>\r\n	<li>\r\n	<h3>15 offices (90 desks)</h3>\r\n	</li>\r\n	<li>\r\n	<h3>3 meeting rooms</h3>\r\n	</li>\r\n	<li>\r\n	<h3>1 conference room (20 seater)</h3>\r\n	</li>\r\n</ul>\r\n\r\n<h3>Price on request&nbsp;</h3>\r\n\r\n<p>Mention Space Hiring to get special Discount !</p>\r\n', 'mum@thinkrise.com', '9911153318', '1465207830_GMVKQW_Rise Mumbai.JPG', 0, 164, 0, 1, 0, 0, '', 37, '2016-11-04 18:57:35');
