(472, '15', '4', 'agent', 'rent', '1', 0, '8600', '', 'north', '', 'Andheri West, Mumbai, Maharashtra, India', 'Commercial Office/Space for lease  in Andheri (West), Mumbai Andheri-DahisarExclusive furnished 8600 sqft built up and 6400 sqft carpet office in andheri west at new link road full glass faced commercial building at veera desai road, . Institutional compl', '<p>Exclusive furnished 8600 sqft built up and 6400 sqft carpet office in andheri west at new link road full glass faced commercial building at veera desai road, . Institutional complex in the business hub.<br />\r\nIt is a five star office having 80 sitting, 1 conference room , Bid cabin and washroom or pantry with huge terrace etc.<br />\r\nThis is strategically located one of the most prime locations in andheri west, Close to all productions houses. Mumbai. This is well connected to key business-Related areas like the domestic air terminal, The international air port, Leading luxury hotels and special business zones.100% power backup for common areas, Provision for full air-Conditioning of the building. Fire fighting &amp; protection systems, 11 feet height in all floors, Independent building for exclusive use also.Please call for more details.</p>\r\n', 'hello@spacehiring.com', '9920200890', '70630045O-1475666708.jpeg', 0, 144, 0, 1, 0, 0, '', 8, '2016-11-20 18:17:54'),
