(490, '15', '1', 'owner', 'rent', '25', 3300, '5000', '5000', 'north', '', 'Chandivali, Mumbai, Maharashtra, India', 'Fully Furnished Office Space in Chandivali Powai', '<p>Tex Center, E Wing, Chandivali, Saki Village, Chandivali Farm Road, Powai, Mumbai - 400072</p>\r\n\r\n<p>Fully furnished office space available from 1-100 seaters, customised as per your requirements, easy upscale &amp; downscale in Tex Center. Strategically located in Chandivali, Andheri (East), our offices provide excellent connectivity with International Airport, JVLR, Powai, Saki Naka, Marol and Andheri-Kurla Road. Set across in multiple floors we have more than 50,000 Square feets of commercial spaces that can cater to organizations of any size to accommodate themselves in one of the most affordable commercial space in Andheri (East). The location is also very close to key residential hubs like &ndash; Saki Naka, Powai, Marol, etc.<br />\r\n<br />\r\nThe building houses few of the famous companies like &ndash; WDS, Intertek, Siyarams, Housing.com, FlipKart.com and is ideal for small medium, and large companies looking for setting up administrative offices, call center, back end processes, business, process outsourcing, etc.</p>\r\n', 'redbrickpls@gmail.com', '9004886740', 'commercial-space-for-rent-in-powai.jpg', 0, 179, 0, 2, 0, 0, '', 10, '2016-11-22 05:05:55'),
(491, '15', '4', 'owner', 'rent', '25', 5550, '7400', '7398', 'north', '', 'Chandivali, Mumbai, Maharashtra, India', 'Fully Furnished Office Space in Chandivali Powai', '<p>Tex Center, E Wing, Chandivali, Saki Village, Chandivali Farm Road, Powai, Mumbai - 400072</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Strategically located in Chandivali, Andheri (East), our offices provide excellent connectivity with International Airport, JVLR, Powai, Saki Naka, Marol and Andheri-Kurla Road. Set across in multiple floors we have more than 50,000 Square feets of commercial spaces that can cater to organizations of any size to accommodate themselves in one of the most affordable commercial space in Andheri (East). The location is also very close to key residential hubs like &ndash; Saki Naka, Powai, Marol, etc.<br />\r\n<br />\r\nThe building houses few of the famous companies like &ndash; WDS, Intertek, Siyarams, Housing.com, FlipKart.com and is ideal for small medium, and large companies looking for setting up administrative offices, call center, back end processes, business, process outsourcing, etc.</p>\r\n', 'redbrickpls@gmail.com', '9004886740', 'offices-in-powai.jpg', 0, 179, 0, 2, 0, 0, '', 39, '2016-11-22 05:09:17'),
(492, '17', '1', 'owner', 'rent', '30', 5000, '', '', 'east', '', 'Mohan Cooperative Industrial Estate, New Delhi, Delhi, India', 'Plug & Play Office In Mohan Estate  ', '<p>Hatch101&nbsp;aims to create an entrepreneurial&nbsp;ecosystem&nbsp;wherein startups can&nbsp;collaborate&nbsp;and work with and&nbsp;around&nbsp;each other.&nbsp;The workspace is&nbsp;comfortable and&nbsp;conducive to innovation and&nbsp;creativity. We strongly believe that teams from diverse backgrounds with diverse strengths can create a strong&nbsp;ecosystem.<br />\r\n<br />\r\nHatch101&nbsp;will have an ideal mix of work with fun from getting sessions organized with&nbsp;various industry experts who will act as mentors to creating a strong database of relevant service providers to help startups launch their business without the unnecessary headaches. In addition,&nbsp;Hatch101&nbsp;will focus on providing a networking platform for startups to pitch to investors.</p>\r\n\r\n<p>Workspace</p>\r\n\r\n<p>At Hatch101, we have both options of seating &ndash; co-working as well as private offices for teams. The private offices are&nbsp;perfect for teams who want to be a part of a co-working community and have the&nbsp;advantages of a private space as well. The common spaces have a fun vibe and distinct aesthetic which inspires the teams as well as your clients who come visit you to our offices.</p>\r\n\r\n<p>Connect, Learn &amp; Grow</p>\r\n\r\n<p>Events are an&nbsp;essential part of the Hatch101 experience. The events at Hatch101 range from meetings with venture capitalists or other industry professionals to carrom and pool tournaments as well as birthday celebrations for the&nbsp;whole community. At Hatch101, we know how to work, and we know how to have fun. These social and professional events help build and&nbsp;maintain a strong&nbsp;community and team culture.&nbsp;</p>\r\n\r\n<p>Tie-Ups with Service Providers</p>\r\n\r\n<p>At Hatch101, our&nbsp;goal is to support&nbsp;the members and our community at every step. We realise that it gets difficult for small teams and&nbsp;individuals to get a competitive rate from the service providers. So our team negotiates rates on behalf of the entire Hatch101 community. Whether its personal assistance services or an advantage of lower cost on healthcare and legal services, the members of Hatch101 have access to all these tie-ups.</p>\r\n\r\n<p>Mentors &amp; Investors</p>\r\n\r\n<p><br />\r\nAt&nbsp;Hatch101&nbsp;we want to invite experienced and successful professionals as well as businessmen who are passionate about entrepreneurship to be a part of our journey. We want them to work with our startups in whatever capacity they wish to, starting from giving guidance on how to build business, raise the right capital or sector specific insights or legal advice on intellectual property or just share ones experiences. We are confident that even an hour a month will surely help our young entrepreneurs. Moreover, there is always a possibility that one chooses to do more than mentoring, and actually becoming an angel investor in the startup!</p>\r\n\r\n<ul>\r\n	<li>Informal interactive sessions or lectures where our Mentors, at their convenience, can come and meet our startups.</li>\r\n	<li>Continue relationship on emails / phone</li>\r\n	<li>Receive quarterly investment pitch-book to evaluate different interesting startups</li>\r\n	<li>Be part of a platform to become an angel investor</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'chandan@hatch101.com', '8506054055', 'Hatch101_Delhi_Coworking.jpg', 0, 173, 0, 1, 0, 0, '', 48, '2016-11-22 06:42:49'),
(493, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Lower Parel, Mumbai, Maharashtra, India', 'co-working spaces in lower parel Mumbai', '<p>A haven for you and your team, a fully furnished hub where you can work in complete privacy and comfort.</p>\r\n', 'conroy.dsouza@jet.one', '8291815591', 'Privateoffice.jpg', 0, 144, 0, 1, 0, 0, '', 30, '2016-11-23 13:29:18'),
(494, '15', '4', 'agent', 'rent', '1', 280, '400', '', 'north', '', 'Andheri East, Mumbai, Maharashtra, India', 'Commercial Office/Space for lease  in Andheri (East), Mumbai Andheri-Dahisar', '<p>Fully furnished commercial office in andheri east with 1 cabin, 4-5 workstations, Pantry &amp; washroom. 5 min walk from marol metro station. Easy connectivity to the highway and other important areas, Easy access by public transport. Excellent for any commercial purpose.</p>\r\n', 'hello@spacehiring.com', '9769118156', '73668812O-1478924886.jpeg', 0, 144, 0, 1, 0, 0, '', 0, '2016-11-24 17:05:58'),
