(496, '2', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Bandra Kurla Complex, Mumbai, Maharashtra, India', 'co-working spaces in Mumbai Bandra Kurla ', '<p>&nbsp;Platina is in a modern office block in Bandra Kurla Complex, a thriving business district in Mumbai. With the centre located on the 9th floor, there are some views of the surrounding area from the offices and meeting rooms.</p>\r\n\r\n<p>Organisations based in the Bandra Kurla Complex include Fortune 500 companies working in banking and financial services, chemical manufacturing and diamond trading. The 12-storey glass and steel Platina building is constructed around a central courtyard area with restaurants, cafes and shops</p>\r\n\r\n<p>Meeting rooms, Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 28, '2016-11-24 17:44:30'),
(497, '15', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Thane West, Thane, Maharashtra, India', 'co-working spaces in Thane (West)', '<p>The Hiranandani -Thane business centre is located in the Tiffany building in Hiranandani Estate. Hiranandani Estate is a condominium style township developed in accordance with the concept of live-work-play. With an elegant infrastructure and attractive amenities, Hiranandani Business Park, Thane is devised carefully with an immaculate setup that is conducive for business growth. The business park offers scalability to its clients with well-decorated entrances and lift lobbies. The breathtaking ambience gives panache to your business address. The business park situated within Hiranandani Estate enjoys a location and lifestyle advantage, being well connected by the Eastern and Western Express Highways with a proximity to an array of leisure options. The township is just 30 minutes away from Thane Railway station.</p>\r\n\r\n<p>Meeting rooms,Day office ,Business lounges, Disabled facilities.</p>\r\n\r\n<p>Flexible workspace for an hour, day, week, month, or years.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 8, '2016-11-25 15:02:27'),
(498, '15', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Cuffe Parade, Mumbai, Maharashtra, India', 'co-working spaces in  Cuffe Parade Mumbai', '<p>The Cuffe Parade business centre is located in Maker Tower. Cuffe Parade has many high end developments and is home to some of the richest and most illustrious businessmen in the country. Colaba Causeway is to the east of Cuffe Parade, the Arabian Sea is to the west and to the North is Nariman Point.</p>\r\n\r\n<p>The centre is a one hour drive to the international and domestic airport, 45 minutes to BKC and is 15 minutes away from Churchgate/CST/ Marine Lines railway station. TCS, UTI, Andhra Bank, Indian Bank and Saudi Arabian Consulate are all located in the vicinity.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '425891-tower.jpg', 0, 144, 0, 1, 0, 0, '', 5, '2016-11-25 15:30:51'),
(499, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Mumbai, Thane, Maharashtra, India', 'co-working spaces in Thane, Mumbai', '<p>The Mumbai Thane Centre is in the Dev Corpora building, a premium high-rise office block on the Eastern Express Highway in Thane. Situated on the 15th floor of the building, there are some views of the surrounding area from the centre. Thane is a popular location for major companies. For example, businesses located near the centre are involved in tile manufacturing, IT and electronics, chemicals and engineering. As well as this a number of dedicated IT parks have recently been built in the area. Thane and the surrounding area has benefited from tremendous improvement to roads and infrastructure in recent years, dramatically cutting travel time to central Mumbai. Located to the north east of Mumbai, Thane is known for its beautiful hills and lakes scenery.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilitie</p>\r\n', 'anupreeta.marwah@gmail.com', '8002094949', 'for_sale_2_bhk_2t_apartments_in_dev_land_housing_ashoka_thane_west_mumbai_4940077455655745811.jpg', 0, 144, 0, 1, 0, 0, '', 13, '2016-11-25 16:08:15'),
(500, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Airoli, Navi Mumbai, Maharashtra, India', 'co-working spaces in  Airoli, Navi, Mumbai', '<p>The Reliable Tech Park business centre is centrally located in Navi Mumbai, a hub for Tech Parks in the city. It is a mixed used development offering a variety of amenities including Food Court, Gaming Zone, Shopping and a Grand Atrium. It is located approx. 28 kms from the international airport, 27 kms from the domestic airport and 2 kms from Airoli railway station Significant development of infrastructure, residential and commercial real estate has made this location a popular destination for IT companies and professionals. The Reliable Tech Park business centre is a preferred choice for both international and domestic companies, looking for flexible and fully equipped office space with professional office services at reasonable cost.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 18, '2016-11-25 16:18:36'),
(501, '15', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Vashi, Navi Mumbai, Maharashtra, India', 'co-working spaces in Vashi, Navi Mumbai,', '<p>Platinum Techno Park stands tall, a landmark in the Vashi skyline overseeing the Mumbai-Pune highway. Perfectly situated in between the nearest station, the highway and the proposed Mumbai International Airport, Platinum IT park is perfect for IT empowered work spaces. The building is situated just 5 minutes walk from Vashi railway station and mere 30 minute drive from the proposed International Airport. Corporates situated in close proximity are Reliance Infocom and Millennium Business Park.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 23, '2016-11-25 16:24:42'),
(502, '15', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Worli, Mumbai, Maharashtra, India', 'co-working spaces in Worli, Mumbai', '<p>The Worli business centre is located on the 1st floor of Imperial Business Park, a landmark building in Shiv Sagar Estate in Worli. Worli is one of the busiest commercial hubs in Mumbai with Shiv Sagar Estate being one of the first major developments. Major companies having offices in the vicinity are GSK Pharma, TATA, Novartis, HDFC Bank, Yes Bank, Siemens and Deloitte. The business centre has good transportation with the nearest train stations at Mahalaxmi and Elphinstone. The Worli-Bandra Sea link has made connectivity to the Western Suburbs and Mumbai Airport easy and quick. The Worli business centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 5, '2016-11-25 16:29:28'),
(503, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Goregaon West, Mumbai, Maharashtra, India', 'co-working spaces in , Goregaon (West), Mumba', '<p>The Malad business centre is located on the 17th floor of DLH Park, an integrated corporate park at the junction of S.V. Road and the Eastern - Western Link Road. The building is directly connected to the Western Express Highway through a flyover and is close to Malad and Goregaon local train stations. It is just 15 minutes drive from the International and Domestic Airports and easily accessible through various modes of transportation. The corporate park is surrounded by prestigious commercial IT Hub and malls like In-orbit, Infinity and Oberoi Mall. The building has many amenities including restaurants, caf&eacute; and banks. The Malad business centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '30089028_20101130143402.jpg', 0, 144, 0, 1, 0, 0, '', 15, '2016-11-25 16:34:31'),
(504, '15', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Goregaon East, Mumbai, Maharashtra, India', 'co-working spaces in  Goregaon (East), Mumbai', '<p>The R Tech Park business centre is located on the 13th floor of this modern office complex, situated in Nirlon Knowledge Park in Goregaon (East), Mumbai. It is located adjacent to the Western Express Highway and is in close proximity to the International (8kms) and Domestic (7km) Airports as well as Goregaon Railway Station (2kms) The Western Express Highway is one of Mumbai&#39;s main arterial roads connecting the western and eastern suburbs of Mumbai. Close proximity to Residential, Commercial and Retail developments has made this area a sought after location for most of Mumbai&rsquo;s professional workforce. The location is well served by a range of amenities and facilities including retail malls, schools, hospitals and recreational and leisure Facilities. The R Tech Park centre is a preferred choice for both international and domestic companies, looking for flexible and fully equipped office space with professional office services at reasonable cost.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 13, '2016-11-25 17:17:56'),
(505, '15', '1', 'owner', 'rent', '0', 0, '', '', 'north', '', 'Andheri West, Mumbai, Maharashtra, India', 'co-working spaces in Andheri West, Mumbai', '<p>The Mumbai Andheri West Centre is in a western suburb of Mumbai, close to Malad, Juhu, Gorgaon, Jogeshwari and the thriving commercial areas of Andheri East and Andheri West. Located on the third floor of an impressive glass-fronted office building, the centre is also close to several industrial estates such as the Laxmi Andheri and the Ghanshyam industrial estates. Andheri West has a good mix of residential, commercial and retail developments. Companies located near the centre work in businesses including electronics, IT, television production, banking and insurance. Situated 2.5km from Andheri train station, there are also plenty of shops, cinemas, hotels and restaurants near the centre. Domestic and international airports are a short drive away and the area is well connected by road and rail to central Mumbai and the surrounding areas.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', 'serviced-offices-r-tech-park-western-express-highway-goregaon-east-mumbai_1_800_562_s.jpg', 0, 144, 0, 1, 0, 0, '', 9, '2016-11-25 17:23:18'),
(506, '15', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Juhu, Mumbai, Maharashtra, India', 'co-working spaces in Juhu, Mumbai, ', '<p>Juhu business centre is located on the 2nd and 3rd floors of Duru House located on Juhu Tara Road. Juhu is an affluent suburb of Mumbai and home to the film industry, celebrities, producers, directors, businessmen, HNI&rsquo;s and media companies. Furthermore, the location hosts a variety of premium retail outlets, star hotels and many fine dining options.</p>\r\n\r\n<p>The centre is situated less than 1 km from Juhu Beach and is next to the JW Marriot Hotel. It is approximately 3.5 kms from the closest metro station and 6.5 kms from the airport. Juhu centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n\r\n<p>Meeting rooms , Day office , Business lounges, Disabled facilities</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 10, '2016-11-25 17:32:32'),
(507, '18', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Powai, Mumbai, Maharashtra, India', 'co-working spaces in Powai, Mumbai,', '<p>The Powai business centre is located on the 2nd floor of Alpha building at Hiranandani Gardens in Powai and is strategically located opposite Powai Lake. This location has been well planned for work spaces and is ideally situated in the midst of many amenities including shopping and entertainment complexes, restaurants and also residential facilities. Powai is home to many leading Global and Indian corporations including Kellogs, TCS, Wipro, Maersk, J.P. Morgan, Credit Suisse, G.E., Deloitte, British Gas, Colgate, General Mills, Syntel, Cognizant, Accenture and Godrej. It is also Mumbai&#39;s main business start-up hub with young entrepreneurs starting off from incubation cells set up by institutes like IIT Bombay from the hi-tech industry. The Powai centre is 5 Kms from the International Airport and 12 Kms from the Domestic Airport. It is also easily accessible by many forms of public transport. The Powai business centre offers a perfect solution for local and overseas companies as well as start up businesses looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', 'images.jpg', 0, 144, 0, 1, 0, 0, '', 24, '2016-11-25 17:39:51'),
(508, '18', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Andheri East, Mumbai, Maharashtra, India', 'co-working spaces in Andheri (East), Mumbai', '<p>The centre is located in Kaledonia, off the Western Express Highway in Andheri (East).</p>\r\n\r\n<p>Kaledonia is a Grade A construction admeasuring approx. 0.6 million sq ft and is strategically located in the heart of Andheri (East). The building hosts a tall atrium lobby of 42 feet with the ceiling made of translucent fibre glass open to sunlight.</p>\r\n\r\n<p>Amenities and Services include - 6 Schindler passenger elevators and 2 Schindler service elevators, CCTV coverage for basement and parts of the ground floor, 24 hours security surveillance and two levels of basement car parks.</p>\r\n\r\n<p>The building is situated within walking distance from the railway station, approx. 1 km off the Western Express Highway, approx. 1.3 kms from Shoppers Stop Mall and approx. 3kms from the Domestic and International Airports.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', 'HY.jpg', 0, 144, 0, 1, 0, 0, '', 23, '2016-11-25 17:46:30'),
