(520, '15', '4', 'agent', 'rent', '1', 0, '1534', '', 'north', '', 'Lower Parel, Mumbai, Maharashtra, India', 'Commercial Office/Space for lease  in Lower Parel, Mumbai South', '<p>Marathon icon (Part of nextgen campus) is one of the commercial developments of marathon realty. The project offers small office spaces at very competitive and affordable price. The site is well connected by different modes of transportation and is in close proximity of various civic utilities. The project is well equipped with all modern amenities and 24x7 security service to facilitate the business needs. The building is ready with occupation. Hence no service tax and vat.</p>\r\n', 'hello@spacehiring.com', '9619426555', '67407305O-1472033499.jpeg', 0, 144, 0, 1, 0, 0, '', 0, '2016-11-25 19:09:26'),
