(522, '17', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Andheri, Maharashtra, India', 'co-working spaces inAndheri, Mumbai,', '<p>Dynasty Business Park is located in the heart of the upcoming business district of North Mumbai which houses corporates like Philips, JP Morgan Chase, Procter &amp;amp;amp;amp; Gamble and many more. The building is a stand alone development of 121,000 sq.ft spread over 7 levels of a commercial development with retail on the ground floor, Company&#39;s like China Shipping , Satyam Infoway, Dynamix dairy and also Hindustan Times Radio Station known as Radio One are located here.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 14, '2016-11-26 15:13:24'),
(524, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Pune, Maharashtra, India', 'co-working spaces in Kumar Business Centre', '<p>Kumar Business centre (KBC) is located at Bund Garden, a prime commercial area of Pune. It consists of ten floors measuring 0.05 million sq. ft. of Developable Area. The building is located in the centre of the city and is well connected to important business locations and has close proximity to the airport and railway stations. The building is equipped with high-speed elevators, optic fibre network, Genset Backup, EPABX system, earthquake resistant, among others. Corporates like Ernst &amp; Young, Price Waterhouse Coopers, KPMG, Philips, Microsoft, ING, POSCO, Bosch and many others are located on Bund Garden Road. Prominent 5 star hotels (Like Taj, Holiday Inn, Le Meridian ) are located around 1 Km radius of the business centre.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 11, '2016-11-26 16:15:41'),
(525, '18', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Pune, Maharashtra, India', 'co-working spaces in Sky One', '<p>The business centre is located in Sky One, Kalyani Nagar, Pune. Sky One is a Grade A commercial development admeasuring approx. 185,000 sq ft and is situated in the Heart of Kalyani Nagar - a prime business hub in Pune. The building hosts double height entrance lobby with reception, lounge seating and concierge, three level car park and global requirements in terms of environment, health and safety standards.</p>\r\n\r\n<p>The building is located in close proximity to the Airport and Railway Station. Star Hotels in the vicinity include Hyatt Regency, Taj Blue Diamond, Le Meredian, Westin.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340tyty.jpg', 0, 144, 0, 1, 0, 0, '', 16, '2016-11-26 16:27:46'),
(526, '15', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Pune, Maharashtra, India', 'co-working spaces in Pentagon P-2', '<p>The Pune Magarpatta City Centre is in an ultra modern office building in Magarpatta City, which is situated on the eastern side of Pune. Located in the Pentagon Towers building, the centre is on the sixth floor with views of the environs from several of the offices and meeting rooms. Magarpatta City is a self-contained residential and commercial settlement spread over several hundred acres. The settlement, which has received awards for its eco friendly design and construction, grew out a movement where farmers who owned the land got together to convert it into an enterprise, rather than have the government take it over. It is now a very sought-after area and is home to many IT parks and industrial estates. Several large Indian and multinational companies have offices close to the centre. The location is excellent as it is just 5km from Pune&#39;s central business district.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 7, '2016-11-27 06:26:20'),
(527, '18', '1', 'owner', 'rent', '2', 0, '', '', 'north', '', 'Pune, Maharashtra, India', 'co-working spaces in World Trade Centre', '<p>The Pune WTC business centre is located in India&#39;s fourth operational World Trade Centre in Kharadi, the centre of Pune&rsquo;s Eastern IT Corridor. The 1.6 million square feet integrated business park is a hub for international trade, providing various services and facilities designed specifically to meet the needs of clients in ITES. This large corporate park contains amenities including many F&amp;B outlets, cafeterias, banks and retail. The centre is just 9 Kms away from the city airport and 12 Kms from the main railway station. Companies like Hyundai Motor India Ltd, Sterlite Group and POSCO Steel have their offices in this complex. The Pune WTC centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', '1568_Exterior.jpg', 0, 144, 0, 1, 0, 0, '', 18, '2016-11-27 06:44:36'),
(528, '15', '1', 'owner', 'rent', '1', 0, '', '', 'north', '', 'Pune, Maharashtra, India', 'co-working spaces in Tech Centre', '<p>Tech Centre is a glass fa&ccedil;ade Grade A building located at the Rajiv Gandhi IT Park, Phase 1, Hinjewadi, Pune and is surrounded by some of India&#39;s largest Blue Chip IT companies.</p>\r\n\r\n<p>Hinjewadi is located towards the start of Pune and is in close proximity to the Mumbai - Pune expressway. Amenities include 2 high speed elevators, 24 hours power back up and security services.</p>\r\n', 'Enquiry@spacehiring.com', '8002094949', 'adaptiveimage.adaptive.full.nocompression.image.jpg', 0, 144, 0, 1, 0, 0, '', 10, '2016-11-27 06:50:04'),
