(534, '18', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Hyderabad, Telangana, India', 'co-working spaces in SLN Terminus Hyderabad', '<p>The SLN Terminus- redefines the conventional concept of work space by integrating work with leisure. The site layout has been strategically conceived to appeal to a large section of audience in terms of its design architecture and space management.</p>\r\n\r\n<p>SLN Terminus &ndash; a Signature mixed use commercial building is located next to the 158 acres Botanical Gardens on Gachibowli, Kondapur Highway and is well connected from all the parts of the city.</p>\r\n', 'regus@gmail.com', '8002094949', 'banner4-1173x440.jpg', 0, 144, 0, 1, 0, 0, '', 17, '2016-11-29 09:30:28'),
