(570, '18', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Ahmedabad, Gujarat, India', 'co-working spaces in  Ahmedabad', '<p>The Ahmedabad GCP Business Centre has leading edge designs and top class facilities to support major International and India corporations. Enveloped in landscaped green area, the four storied building creates an ideal ambience for quiet efficiency and productivity. The centre is strategically located at Vijay Chra Rasta, a cross road with excellent road, rail and airport connections, The centre is located in of Ahmedabad&#39;s central business district supporting many professional &amp;amp;amp;amp; entrepreneurial ventures. Its location also renders it within close proximity to many major Banks, Hotels, restaurants &amp;amp;amp;amp; high end residential areas. Other key features of the facility include high space efficiency and ceilings, adequate car parking space and full back up facilities. A large number of major International and Indian corporate have offices in this area including ICICI Bank, AXIS Band and the National Stock Exchange.</p>\r\n', 'regus@gmail.com', '8002094949', '1324530325.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-01 16:51:45'),
(571, '15', '4', 'agent', 'rent', '1', 0, '', '', 'north', '', 'Ahmedabad, Gujarat, India', 'co-working spaces in  Ahmedabad', '<p>Earth Arise is a Grade A Construction situated on SG Highway, which is now fast becoming the largest commercial business hub of the city. Earth Arise is a LEED Gold Certificate Green Building with Eco Friendly building design. The building has a roof top caf&eacute; and gymnasium for its occupants, around the clock CCTV, Fresh Air induction system for each office, Hydraulic dual level parking and serene landscaping.</p>\r\n\r\n<p>The location has witnessed significant growth in commercial office supply, hotels, retail and residential developments with a large amount of FDI. The building is situated in close proximity to ISCON Junction - a landmark crossing in Ahmedabad, 800 meters from Novotel and near YMCA Club - a prestigious club in Ahmedabad.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Secure, business-grade internet and WiFi</li>\r\n	<li>Phone handset and lines</li>\r\n	<li>Use of 50 million WiFi hotspots around the world</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n', 'regus@gmail.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 22, '2016-12-01 17:06:27'),
(572, '15', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Chennai, Tamil Nadu, India', 'co-working spaces in  Chennai', '<p>The Chennai Egomre business centre is located in Samson Towers, a landmark building, strategically located at Egmore, one of the major commercial business districts of Chennai. The centre building is an office complex which affords excellent aerial views of the city on three sides. The centre is 2km from Egmore Station and is well connected to other parts of the city by major intercity road networks. The nearest bus station is just 50 metres away and the international airport is 13 kms from the centre.</p>\r\n\r\n<p>Many of Chennai&#39;s business and corporate offices of public sector banks and companies are located in the vicinity The Chennai Egmore centre offers a perfect solution for local and overseas companies who want to start or grow their businesses in Chennai and are looking for flexible and fully-equipped offices with comprehensive services at a reasonable price..</p>\r\n\r\n<p>Professional space to meet, pitch, train and interview, with WiFi, projectors, whiteboards and support from our team.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n', 'regus@gmail.com', '8002094949', 'dc15521059c9f850aeae4d