(594, '15', '4', 'agent', 'rent', '2', 298, '459', '', 'east', '', 'Mumbai, Maharashtra, India', ' Commercial Office/Space for Lease in kailas business park, Ghatkopar West, Central Mumbai suburbs ', '<p>This is my own office and i shall be paying brokerage<br />\r\n<br />\r\nKailas business park, Ghatkopar - Off hiranandani powai<br />\r\n<br />\r\nGlass facade it tower<br />\r\nThe best building in the location<br />\r\n5 elevators for each wing<br />\r\nEast west entry - Best as per vaastu<br />\r\nDeveloper has his office in the same wing<br />\r\nFlooring and washroom is done<br />\r\nDouble height with clear standing loft to double space<br />\r\nOne car park<br />\r\nOpen to business centre agreement<br />\r\nOpen to franchisee agreement<br />\r\n<br />\r\nUnit is 606 in b wing - It shall be around 11th floor from ground as there are seven levels of car parking<br />\r\nArea - 459 bup - 298 carpet<br />\r\nRent is rs.35,000 per month</p>\r\n', 'hello@spacehiring.com', '9820445840', '55813647O-1458366942.jpg', 0, 144, 0, 1, 0, 0, '', 13, '2016-12-05 17:18:01'),
