(596, '15', '4', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Chandigarh, India', 'co-working spaces in  Chandigarh', '<p>The Harmony business centre is located at Godrej Eternia, a Grade A building with LEED Platinum pre-certification. This is only the second Grade A building at Chandigarh located in proximity of the Airport within the planned Industrial Area.</p>\r\n\r\n<p>The complex has many amenities including fine dining options, premium cafes and other retail brands within close vicinity of 1-2 kms. Many major global MNCs are in the immediate vicinity. The centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n', 'regus@gmail.com', '8002094949', 'timthumb.php.jpg', 0, 144, 0, 1, 0, 0, '', 8, '2016-12-06 18:18:49'),
(597, '15', '4', 'agent', 'rent', '3', 0, '', '', 'north', '', 'Gurgaon, Haryana, India', 'co-working spaces in  Gurgaon', '<p>The Sohna Road business centre is located at Space i-Tech Park. Spread over 10 acres of land on Sector-49 Gurgaon, Spaze i-Tech Park offers an excellent working environment to IT and IT enabled organizations. With more than 1.4 million sq. ft in area, Spaze has ingeniously integrated commercial and retail spaces, to give you a world class working environment. It is well connected by a 6 lane express highway NH-8 and an international airport at 20 minutes drive. With major landmark hotels (Fortune, Orchid and Radisson), shopping centres (like Shoppers Stop), Entertainment and recreational hotspots (32 milestone, Haldiram&#39;s) at short distance from the business centre, it is indeed a workplace to be in. Major MNC&#39;s like Xerox, Mckinsey and Co, UNINOR, NDTV Worlwide have set up their offices in the vicinity of Spaze towers.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Secure, business-grade internet and WiFi</li>\r\n	<li>Phone handset and lines</li>\r\n	<li>Use of 50 million WiFi hotspots around the world</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '2016_04_0