(598, '15', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Gurgaon, Haryana, India', 'co-working spaces in  Gurgao', '<p>The Gurgaon JMD Regent Square Centre is in a Grade A glass-fronted office building on Mahatma Gandhi Road, the main commercial hub of Gurgaon. Situated on the fifth, sixth and seventh floors, there are some views of the surrounding area from the centres offices and meeting rooms. Businesses located nearby include Indian and multinational companies working in banking and financial services, IT and telecoms. Other important industries in the city include business outsourcing, especially call centres, real estate and garment and automobile manufacturing. The centre is located just 22 km from Dehli airport and a bus station with access to the metro is just outside the building. Gurgaon is also well known for its shopping malls and there are many within close proximity of the centre.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Secure, business-grade internet and WiFi</li>\r\n	<li>Phone handset and lines</li>\r\n	<li>Use of 50 million WiFi hotspots around the world</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '6_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-06 18:42:37'),
(599, '15', '1', 'agent', 'rent', '3', 0, '', '', 'north', '', 'Gurugram, Haryana, India', 'co-working spaces in  Gurgao', '<p>Udyog Vihar is Gurgaon&#39;s first Industrial Township and houses the landmark Maruti Plant in its vicinity. The business centre is located on Level 5 of Srei Signature Tower, just adjacent to Maruti Plant Gate and behind Bharti Airtel building on NH8, Gurgaon. The business centre is very close to Delhi and is a few minutes away from Cyber City. It is accessible by road and on the metro network. Delhi international airport is 10 mins away. Large Indian as well as multinational corporations such as Airtel, GE, Accenture, TCS, PSK are located in the neighborhood making this an ideal location for your business. The nearest metro station is MG Road, which is just 10 min away.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Secure, business-grade internet and WiFi</li>\r\n	<li>Phone handset and lines</li>\r\n	<li>Use of 50 million WiFi hotspots around the world</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '3_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 5, '2016-12-06 18:48:11'),
(600, '15', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Gurgaon, Haryana, India', 'co-working spaces in  Gurgao', '<p>The Gurgaon Augusta Point Centre is in the heart of Gurgaon, one of India&#39;s most respected business locations. Gurgaon has emerged as a top choice for Fortune 500 company headquarters, with nearby firms working in the likes of banking and financial services, IT and telecommunications. Gurgaon which is just 30km south of New Delhi is also a key location for call centres. Garment manufacturing and car manufacturing are other important industries along with real estate and construction. The centre is close to several shopping malls and restaurants.</p>\r\n', 'regus@gmail.com', '8002094949', '2_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 11, '2016-12-07 17:28:38'),
(601, '15', '1', 'agent', 'rent', '1', 0, '', '', 'north', '', 'gurgaon ', 'co-working spaces in  Gurgaon', '<h2>The Delhi Rectangle Centre is a prime commercial and residential area called Saket in South Delhi. Located on the fourth floor of a prestigious office block, the centre is just beside the Marriott Hotel. The building has a lovely atrium which brings light to the offices and meeting rooms as well as convenient basement parking. Neighbouring companies work in the hi- tech mobile phone industry, IT and professional services. Like many parts of India, Saket is growing and changing and is now a strong commercial district with several office complexes, shopping malls and multiplexes newly opened, and with more planned. The centre is in close proximity to the central business district, Nehru Place, Modia and the main access road to Gurgaon.</h2>\r\n', 'regus@gmail.com', '8002094949', 'Rectangle-No-1-Saket-New-Delhi-Office-Rental-1.jpg', 0, 144, 0, 1, 0, 0, '', 9, '2016-12-07 17:41:33'),
(602, '15', '1', 'agent', 'rent', '3', 0, '', '', 'north', '', 'New Delhi, Delhi, India', 'co-working spaces in  New Delhi', '<p>This new centre is situated at a Grade A building in South Extension part II, which is an affluent commercial and retail high-street located in South Delhi The location has many amenities including fine dining options, premium cafes and other retail brands within close vicinity and is well connected by the public transport network.</p>\r\n\r\n<p>Many major global MNCs and banks are in the immediate vicinity such as HSBC, Citibank, Yes Bank and also F&amp;B and retail chains such as Starbucks, Mcdonald&rsquo;s and KFC. The centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'regus@gmail.com', '8002094949', '1_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-07 17:46:08'),
(603, '15', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'New Delhi, Delhi, India', 'co-working spaces in  New Delhi', '<h2>110001</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Connaught Place business centre is strategically located in a state-of-the-art commercial office complex in the heart of New Delhi&rsquo;s central business district, Connaught Place. The complex, located on Bhai Veer Singh Marg, Connaught Place&rsquo;s high security VIP zone, includes wide entrance roads, a 5 tiered security program, extensive parking facilities and spectacular views of New Delhi. It is a Grade A+, LEED certified integrated commercial building. The complex has many amenities including fine dining options, premium cafes and other retail brands. Many major global MNCs and banks, the President&rsquo;s estate, Parliament House, Central Ministries and Diplomatic Enclave are in the immediate vicinity. The business centre is well connected to other parts of the city by the metro rail and major inter-city road network. It is 3.5 Kms away from New Delhi railway station and 13 Kms away from the Airport. The Connaught Place business centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'regus@gmail.com', '8002094949', '2_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-07 17:55:31'),
(604, '15', '1', 'agent', 'rent', '0', 0, '', '', 'north', '', 'new delhi', 'co-working spaces in  New Delhi', '<p>The business centre is located in Connaught Place, New Delhi, in the Lower ground level of the Shivaji Stadium Metro Station, a key transport hub in Connaught Place.</p>\r\n\r\n<p>This Station is on the Airport Express Metro Line that links the CBD with the Indira Gandhi International Airport and New Delhi Railway Station. The location also supports 150,000 sq ft of commercial space : 100,000 sq ft of offices and 50,000 sq ft of Retail.</p>\r\n', 'regus@gmail.com', '8002094949', '2_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 19, '2016-12-07 18:08:11'),
(605, '15', '4', 'agent', 'rent', '2', 1000, '', '', 'north', '', 'Ghatkopar West, Mumbai, Maharashtra, India', 'Space at Hill View Industrial Estate', '<p>Spacious Office space at Ghatkopar West.</p>\r\n\r\n<p>Close proximity to the railway station and Easter Express&nbsp;highway&nbsp;</p>\r\n\r\n<p>Area : 1000 carpet&nbsp;</p>\r\n\r\n<p>Rent - 60000 rs&nbsp;</p>\r\n\r\n<p>Deposit - 3,00,000/- rs&nbsp;</p>\r\n', 'parekh.hemang@gmail.com', '9820948070', 'fully_furnished_office_space_for_lease_at_goregaon_east_4050113475626306704.jpg', 0, 189, 0, 1, 0, 0, '', 25, '2016-12-08 09:32:21'),
(606, '15', '4', 'agent', 'rent', '2', 0, '', '', 'east', '', 'Noida, Uttar Pradesh, India', 'co-working spaces in  Noida', '<p>The Tapasya business centre is located in sector 126 in Noida and is located on the Noida Expressway. Its strategic location provides great visibility and accessibility to both New Delhi and other NCR towns. Major Corporates such as HCL, Hewitt, Alstom, Eaton, CPA Global &amp; Oracle have their offices in the vicinity. It is also a major hub for multinational firms outsourcing IT services. The centre is 28kms from the New Delhi International airport and 23kms from the railway station. The Tapasya business centre offers a perfect solution for local and overseas companies looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n', 'regus@gmail.com', '8002094949', '20160910120420-90297.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-08 17:40:40'),
(607, '15', '1', 'agent', 'rent', '2', 0, '', '', 'north', '', 'Noida, Uttar Pradesh, India', 'co-working spaces in  Noida', '<p>Noida S B Tower is planned with flexible, adaptable modular Grids to suit nouveau work practices. It is located in the fully developed most premium Sector - 16A and is abutted by wide roads. The building in this Sector-16A houses top corporate offices and is a destination for many corporate, IT. and B.P.O. organizations like BHEL, GAIL Freescale, Jubilant Organosys, CNBC, ZEE TV, Bag Films etc. The building is easily accessed by various modes of public transport including trains, buses, cabs and private vehicles. Several national and international banks are also located in the proximity like IDBI, SBI and HDFC. Various palaces of entertainment are present in and around sec 16 A. Apeejay International School is also located nearby the centre.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '11_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 0, '2016-12-08 17:52:23'),
(608, '15', '1', 'agent', 'rent', '3', 0, '', '', 'north', '', 'Noida, Uttar Pradesh, India', 'co-working spaces in  Noida', '<p>The business centre is located in the Green Boulevard that is the World&#39;s Largest Platinum rated LEED certified Green Building with facilities such as an amphitheatre, a gym, a cafeteria and shops, the three towers are designed around shaded landscape courts with water bodies and plants, which helps to reduce the ambient temperature. The building depth has been optimized to capture daylight and to maximize views. Large Indian as well multinational corporations are located in the campus.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '2_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 11, '2016-12-08 18:00:02'),
(609, '15', '4', 'agent', 'rent', '4', 0, '', '', 'north', '', 'Coimbatore, Tamil Nadu, India', 'co-working spaces in coimbatore', '<p>The Coimbatore business centre is strategically located at Avinashi Road, one of the major commercial business districts of the city. The centre building is a premium office complex, which is well connected to other parts of the city by major intercity road networks. The nearest bus station is just 50 metres away. Many of Coimbatore&#39;s business and corporate offices of public sector banks and companies are located in the vicinity. The Coimbatore centre offers a perfect solution for local and overseas companies who want to start or grow their businesses in Coimbatore and the neighbouring district of Tirupur and who are looking for flexible and fully-equipped offices with comprehensive services at a reasonable price.</p>\r\n\r\n<ul>\r\n	<li>Modern, ergonomic office furniture</li>\r\n	<li>Professional business environment</li>\r\n	<li>Convenient locations in the places you do business</li>\r\n	<li>Use of community meeting rooms by the hour</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mail received by our reception team</li>\r\n	<li>Access to administrative support, to help with tasks like document collation or arranging couriers</li>\r\n	<li>Access to a printer, scanner and photocopier</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Receptionist to greet guests</li>\r\n	<li>Communal kitchen with tea and coffee making facilities</li>\r\n	<li>Business lounge and smaller break-out areas</li>\r\n	<li>All utility costs included</li>\r\n	<li>Office cleaning and maintenance</li>\r\n	<li>24/7 building security</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'regus@gmail.com', '8002094949', '2_454x340.jpg', 0, 144, 0, 1, 0, 0, '', 12, '2016-12-08 18:18:51'),
