(700, '15', '1', 'owner', 'rent', '2', 0, '', '', 'north', '', 'Pune, Maharashtra, India', ' Commercial Office/Space for Sale in Marvel Edge, Viman Nagar, Pune ', '<p>Marvel edge boasts of environmentally-Sustainable designs, With a profusion of greenery. Never seen before facilities like natural lighting, Breakout spaces, Inclusiveness of complex and advanced security systems further enhance the experience that is marvel edge.<br />\r\n<br />\r\nThe piece de rsistance is the immaculately planned construction that really gives marvel edge the absolute edge. Small details like engineering based on the sun path analysis ensure that natural sunlight seeps into the building at all times. Manually operable louvers allow the occupant to control the amount of sunlight coming in to cut the heat. These sunscreens have been planned in such a way that the glass faade is kept cool, Which reduces temperatures in the office. Therefore, It cuts down on the power consumption.<br />\r\nIn a 9-To-5 world where monotony, Drudgery and boredom reside in the same cubicle, Comes a revolution to the workplace. One that is innovative in design, Imagination and size. It goes by the name of marvel edge.<br />\r\nMarvel edge viman nagar sale for office<br />\r\nIt is a place that is not just files and folders, A place that is not just brick and mortar. Marvel edge is a place that is organic in nature and brilliant in design.<br />\r\n<br />\r\nHere, Love for ecology melds seamlessly with excellence in business. Natural resources are not pawned for commercial resources. Because we believe that a self sustaining ecosystem facilitates business, Encourages individuality, And is like a breath of fresh air to the monochromatic confines of traditional business spaces</p>\r\n', 'hello@spacehiring.com', '9823386525', '29346671O-1464964481.jpeg', 0, 144, 0, 1, 0, 0, '', 6, '2016-12-17 17:34:35'),
