(766, '18', '1', 'owner', 'rent', '10', 435, '', '', 'north', '', 'Hyderabad, Telangana, India', 'Fully Furnished Office Space in SLN Terminus, Beside Botanical Gardens', '<p>SLN Terminus is blessed with aesthetic brilliance, intelligent planning and scientific approach. The core strengths of SLN Terminus is the site layout has been strategically conceived to appeal to a large section of audience in terms of its design architecture and space management. The 3-level atrium ensures natural light in abundance and 2-level hydraulic parking makes sure that there will never be a shortage of parking space. All floors have spacious lobbies to accommodate excess crowd during peak hours and are serviced by dedicated elevators and escalators.<br />\r\n<br />\r\n3 entry routes for vehicles and 2 pedestrian access points make traffic management efficient and hassle-free. This apart, splendid views of the verdant botanical garden and healthy cross ventilation make SLN Terminus a one-of-a-kind project.<br />\r\nSLN Terminus business centre in hyderabad has a strategic location advantage which is bolstered by state of the art facilities integrated in infrastructure developed in line with world class standards to complement the upscale lifestyle of your managers and staff.<br />\r\n<br />\r\nWe at SLN Terminus have taken offering solution to a newer level wherein customers looking for ramp up and ramp down or plug n play models from 1 seater arrangement till 600 seater arrangement with serviced, flexible and furnished office spaces can enjoy the locational advantage with us on 6th floor of the building. We currently run an exuberating Coworking space in Hyderabad which has a capacity to hold 300 seats plus capacity to offer 24/7 operations &ndash; as first of its kind in SLN Terminus business centre in hyderabad.</p>\r\n', 'redbrickpls@gmail.com', '9004886740', 'SLN Terminus.jpg', 0, 179, 0, 1, 0, 0, '', 12, '2017-01-06 06:50:00'),
