(774, '<p><strong>1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>The Licensee acknowledges and understands that it suse of the Premises and the Facilities is only in terms of a license and does not constitute a lease or sublease and does not create any estate, right, title or interest whatsoever in the Premises.</p>\r\n\r\n<p><strong>1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>The Licensee acknowledges and understands that its use of the Premises and Facilities are privileges that may be revoked at any time at SE&rsquo; ssole and absolute discretion. If Licensee&rsquo;s use of the Premises and Facilities are revoked, the Licensee will no longer be permitted to conduct its Business from the Premises and/or to enjoy the Facilities.</p>\r\n\r\n<p><strong>1.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>The Licensee agrees motto misuse the Premises and Facilities or to carry out any purpose, business or activity not envisaged under this Agreement at the Premises.</p>\r\n\r\n<p><strong>1.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>The Licensee understands that its use of the Premises and Facilities may, at the sole and absolute discretion of SE, be disrupted on occasion. The disruption may be for any reason whatsoever, including but not limited to: (i) offering of events or services on the Premises; and (ii) the need to move to another work area and under rare circumstances, to vacate the Premises entirely. SE shall make reasonable endeavors &nbsp;to inform the Licensee in advance of any known disruptions to access of the Premises or to use of any Facilities.</p>\r\n', 420),
