(805, '<p>Our coworking space is most suitable for Tech-Entrepreneurs with 2 to 3 member team.</p>\r\n\r\n<p>Take that plunge! We&rsquo;ve got you covered. Our community is comprised of Freelancers &amp; Solo founders too.&nbsp;</p>\r\n\r\n<p>Whether you are into hyper-local delivery, edtech or travel. We&rsquo;ve previously hosted fast growing startups, to scale thier operations in Mumbai.</p>\r\n', 7),
(806, '<ol>\r\n	<li>\r\n	<ol>\r\n		<li>\r\n		<p>The User shall not use the Work Space Solutions provided by Awfis to carry out any illegal activities or use the same in violation of law.</p>\r\n		</li>\r\n		<li>\r\n		<p>The User shall be responsible for leaving the Work Space Solutions provided by Awfis in the condition that it was given to it. The User may be held liable for the repair cost for all damages to the Work Space Solutions and items therein during its use thereof&nbsp;and the same shall stand adjusted from the User&rsquo;s wallet and/or shall be payable by User.</p>\r\n		</li>\r\n		<li>\r\n		<p>This Work Space Solution provided by Awfis is intended solely for Users who are 18 years of age or older. Any person who is below 18 years of age can only transact under the registration of his/her legal guardian/parents. Awfis reserves the right to terminate any use or access to Work Space Solution if it is found that the User is ineligible to use the Application on account of being a minor. Any use or access of a Work Space Solution by anyone under 18 except under that of his/her legal guardian/parents is unauthorized and in violation of these Terms of Use.</p>\r\n		</li>\r\n		<li>\r\n		<p>The User shall be responsible for providing the correct information. In case the information is found false/inaccurate/incomplete and/or not in accordance with the terms of usage Awfis shall have the right to suspend or terminate or block access to the mobile App and also Work Space Solution. The User shall indemnify Awfis for any loss, harassment etc. to Awfis on account of such information.</p>\r\n		</li>\r\n		<li>\r\n		<p>The User shall always carry valid Identity proof at the time of access and its usage of Work Space Solution.</p>\r\n		</li>\r\n		<li>\r\n		<p>The User while making use of Work Space Solutions provided by Awfis shall not infringe the rights of any person or entity, including without limitation, their intellectual property, privacy, publicity or contractual rights;</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n', 18),
