(810, '<p>No Smoking</p>\r\n\r\n<p>No illegal work from workstation.</p>\r\n', 44),
(811, '<p>1. Don&#39;t&#39; be wasteful. We care about the planet. So print on paper only if you have to. Switch of the A/C when you don&#39;t need it. Do you really need a fresh cup or glass every time you need a drink? Think about that stuff.</p>\r\n\r\n<p>2. We love having your furry friends in our office. But please make sure they :ion&#39;t disturb/terrorize any of the other people working here. And also,And also please do pick up after they do their business.</p>\r\n\r\n<p>3. Take care of your belongings. And well, respect all the stuff already.</p>\r\n\r\n<p>4. If you take a book from the shelf do put it back in the same place at the end of the day. Also, don&#39;t take any of these books home without letting either Karan or Mika know.</p>\r\n\r\n<p>5. Communicate. Are you going to have a small meeting with a few persons in the office? Let Mika know so we can make sure that the meeting area is available for you to use, so that everyone is comfortable, and you can have your meeting in peace.</p>\r\n\r\n<p>6. Call your friends over! Of course you want them to see the awesome new place you work from. We love visitors! Just try not to be too disruptive.</p>\r\n\r\n<p>7. Ever hear of &quot;Feierabendbier&quot;? Now you have. We love this little tradition of having a chilled beer after work (or during). There&#39;s always beer available in our refrigerator for you to consume at MRP. However, this does not make our work space a party/pub. Be mindful.</p>\r\n\r\n<p>8. Smoking is death. But if you must, as a lot of us do, please smoke outside.</p>\r\n\r\n<p>9. n&#39;t set the place on fire.</p>\r\n', 58),
