INSERT INTO `testimonial` (`id`, `name`, `testimonial_image`, `description`, `content`, `created_on`) VALUES
(1, 'Subha', '1_testimonial.jpg', '<p><strong>by raj&nbsp;</strong></p>\r\n', 'As a startup, you have limited money and limited time. SpaceHiring saved us both. We were able to quickly secure a flexible solution until we found a permanent space—and only pay for the space we needed when we needed it. Interestingly, what was initially', '2016-07-26 18:53:09'),
(2, 'Varun Khurana', '2_testimonial.jpg', '<p>Content user</p>\r\n', '\"We needed a flexible solution while we worked on securing a permanent space. What we thought was going to be a 2-month stay turned into nearly 9 months. SPACEHIRING gave us the flexibility and convenience to deal with the unpredictable NYC office leasing', '2016-07-26 18:44:42'),
(5, 'Saadhika', '5_testimonial.jpg', '<p>testi 1&nbsp;</p>\r\n', '\"Our space was configured for a group larger than we currently had. Within days, SpaceHiring helped us set up an account and post the space. Within a day we had a new tenant for the space. The ease at which we could advertise the space and book it was ama', '2016-07-26 19:07:22');
